INSERT INTO `question_details` VALUES (1, 1, 'a', '<p>Adakalanya saya tidak mengetahui sampai sejauh mana kemajuan pekerjaan anggota saya.</p>', 0, '2022-02-05 04:59:59', '2022-02-05 04:59:59', NULL);
INSERT INTO `question_details` VALUES (2, 1, 'b', '<p>Saya selalu berusaha mengetahui sejauh mana kemajuan pekerjaan anggota saya.</p>', 1, '2022-02-05 04:59:59', '2022-02-05 04:59:59', NULL);
INSERT INTO `question_details` VALUES (3, 2, 'a', '<p>Dalam diskusi besar, lebih baik saya membatalkan keinginan untuk menyampaikan pendapat yang berpotensi terjadinya perdebatan.</p>', 0, '2022-02-05 05:00:32', '2022-02-05 05:00:32', NULL);
INSERT INTO `question_details` VALUES (4, 2, 'b', '<p>Dalam diskusi besar, saya akan menyampaikan informasi apa adanya meskipun harus menghadapi banyak perdebatan.</p>', 1, '2022-02-05 05:00:32', '2022-02-05 05:00:32', NULL);
INSERT INTO `question_details` VALUES (5, 3, 'a', '<p>Dalam pengalaman hidup saya, berkata apa adanya berakibat hubungan kurang enak.</p>', 0, '2022-02-05 05:01:13', '2022-02-05 05:01:13', NULL);
INSERT INTO `question_details` VALUES (6, 3, 'b', '<p>Dalam pengalaman hidup saya, orang-orang mengharapkan saya berbicara apa adanya.</p>', 1, '2022-02-05 05:01:13', '2022-02-05 05:01:13', NULL);
INSERT INTO `question_details` VALUES (7, 4, 'a', '<p>Masukan / pendapat yang berbeda dengan saya pasti salah karena saya sudah memikirkan secara matang.</p>', 0, '2022-02-05 05:01:45', '2022-02-05 05:01:45', NULL);
INSERT INTO `question_details` VALUES (8, 4, 'b', '<p>Masukan / pendapat dari orang lain akan saya pikirkan dulu baru saya ambil keputusan.</p>', 1, '2022-02-05 05:01:45', '2022-02-05 05:01:45', NULL);
INSERT INTO `question_details` VALUES (9, 5, 'a', '<p>Apabila mendapatkan tugas, meskipun sakit saya akan tetap menyelesaikan pekerjaan.</p>', 1, '2022-02-05 05:02:27', '2022-02-05 05:02:27', NULL);
INSERT INTO `question_details` VALUES (10, 5, 'b', '<p>Lebih baik saya istirahat saat sedang sakit, karena pekerjaan bisa dikerjakan dilain waktu.</p>', 0, '2022-02-05 05:02:27', '2022-02-05 05:02:27', NULL);
INSERT INTO `question_details` VALUES (11, 6, 'a', '<p>Saya selalu penasaran terhadap tugas sulit dan menantang meski harus dianggap konyol.</p>', 0, '2022-02-05 05:03:00', '2022-02-05 05:03:00', NULL);
INSERT INTO `question_details` VALUES (12, 6, 'b', '<p>Dalam kondisi saat ini, bekerja sesuai aturan merupakan langkah yang tepat.</p>', 1, '2022-02-05 05:03:00', '2022-02-05 05:03:00', NULL);
INSERT INTO `question_details` VALUES (13, 7, 'a', '<p>Dalam bergaul dengan teman, saya selalu berhati-hati agar tidak menyinggung perasaannya.</p>', 0, '2022-02-05 05:03:40', '2022-02-05 05:03:40', NULL);
INSERT INTO `question_details` VALUES (14, 7, 'b', '<p>Dalam bergaul dengan teman-teman saya merasa nyaman dan tidak khawatir akan tersinggung.</p>', 1, '2022-02-05 05:03:40', '2022-02-05 05:03:40', NULL);
INSERT INTO `question_details` VALUES (15, 8, 'a', '<p>Kalau hanya sekedar pelanggaran kecil, mengapa harus dipermasalahkan.</p>', 0, '2022-02-05 05:04:15', '2022-02-05 05:04:15', NULL);
INSERT INTO `question_details` VALUES (16, 8, 'b', '<p>Sekecil apapun jenis pelanggaran tidak bisa ditolerir.</p>', 1, '2022-02-05 05:04:15', '2022-02-05 05:04:15', NULL);
INSERT INTO `question_details` VALUES (17, 9, 'a', '<p>Saya memaklumi jika anggota tidak masuk kantor hari ini karena sedang&nbsp;berduka.</p>', 1, '2022-02-05 05:04:45', '2022-02-05 05:04:45', NULL);
INSERT INTO `question_details` VALUES (18, 9, 'b', '<p>Apapun alasannya pekerjaan dan kantor harus diutamakan.</p>', 0, '2022-02-05 05:04:45', '2022-02-05 05:04:45', NULL);
INSERT INTO `question_details` VALUES (19, 10, 'a', '<p>Saya rasa tidak mungkin seseorang dapat mengetahui kelemahan dan kelebihannya dengan tepat.</p>', 0, '2022-02-05 05:05:13', '2022-02-05 05:05:13', NULL);
INSERT INTO `question_details` VALUES (20, 10, 'b', '<p>Saya sangat memahami kelemahan-kelemahan dan kelebihan-kelebihan yang ada pada diri saya.</p>', 1, '2022-02-05 05:05:13', '2022-02-05 05:05:13', NULL);
INSERT INTO `question_details` VALUES (21, 11, 'a', '<p>Hendaknya dipandang suatu bijak untuk memperoleh simpati masyarakat.</p>', 0, '2022-02-05 05:07:53', '2022-02-05 05:07:53', NULL);
INSERT INTO `question_details` VALUES (22, 11, 'b', '<p>Saya tindak lanjuti dengan memerintahkan staf untuk melaksanakannya.</p>', 1, '2022-02-05 05:07:53', '2022-02-05 05:07:53', NULL);
INSERT INTO `question_details` VALUES (23, 12, 'a', '<p>Demi kebaikan hubungan pertemanan saya selalu bicara apa adanya.</p>', 1, '2022-02-05 05:08:26', '2022-02-05 05:08:26', NULL);
INSERT INTO `question_details` VALUES (24, 12, 'b', '<p>Agar pertemanan tetap terpelihara dalam berperilaku saya selalu mempertimbangkan perasaan orang lain.</p>', 0, '2022-02-05 05:08:26', '2022-02-05 05:08:26', NULL);
INSERT INTO `question_details` VALUES (25, 13, 'a', '<p>Ada atau tidak ada rencana bagi saya sama saja.</p>', 0, '2022-02-05 05:08:58', '2022-02-05 05:08:58', NULL);
INSERT INTO `question_details` VALUES (26, 13, 'b', '<p>Bagi saya, rencana mutlak harus ada.</p>', 1, '2022-02-05 05:08:58', '2022-02-05 05:08:58', NULL);
INSERT INTO `question_details` VALUES (27, 14, 'a', '<p>Seandainya saya dipekerjakan sebagai salesman, saya akan bekerja keras untuk mempelajari teknik-teknik pemasaran.&nbsp;</p>', 0, '2022-02-05 05:09:31', '2022-02-05 05:09:31', NULL);
INSERT INTO `question_details` VALUES (28, 14, 'b', '<p>Seandainya saya dipekerjakan sebagai salesman, saya akan dapat menyenanginya karena mudah bagi saya untuk meyakinkan orang.</p>', 1, '2022-02-05 05:09:31', '2022-02-05 05:09:31', NULL);
INSERT INTO `question_details` VALUES (29, 15, 'a', '<p>Lebih baik memuji terlebih dahulu pekerjaan anggota meski hasil kerjanya belum memuaskan baru kemudian mengkritisinya.&nbsp;</p>', 1, '2022-02-05 05:10:03', '2022-02-05 05:10:03', NULL);
INSERT INTO `question_details` VALUES (30, 15, 'b', '<p>Semua pekerjaan adalah tugas dan tanggung jawab bersama, sehingga tidak perlu memberikan pujian.</p>', 0, '2022-02-05 05:10:03', '2022-02-05 05:10:03', NULL);
INSERT INTO `question_details` VALUES (31, 16, 'a', '<p>Lebih baik membatalkan keinginan jika hal itu dapat menyinggung perasaan orang lain.</p>', 0, '2022-02-05 05:10:36', '2022-02-05 05:10:36', NULL);
INSERT INTO `question_details` VALUES (32, 16, 'b', '<p>Menurut saya dalam menyampaikan keinginan tidak terlalu penting untuk mempertimbangkan perasaan orang lain.</p>', 1, '2022-02-05 05:10:36', '2022-02-05 05:10:36', NULL);
INSERT INTO `question_details` VALUES (33, 17, 'a', '<p>Tidak masalah jika memang pimpinan tidak menyukai saya karena perkataan saya yang terlalu apa adanya, yang penting saya telah berkata sesuai fakta, tidak dibuat-buat.&nbsp;</p>', 1, '2022-02-05 05:13:12', '2022-02-05 05:13:12', NULL);
INSERT INTO `question_details` VALUES (34, 17, 'b', '<p>Rumor yang beredar mengenai pimpinan biasanya cenderung mengungkap kebenaran tentang dirinya dibanding dengan apa yang saya ketahui.</p>', 0, '2022-02-05 05:13:12', '2022-02-05 05:13:12', NULL);
INSERT INTO `question_details` VALUES (35, 18, 'a', '<p>Saya berhati-hati dalam mengambil keputusan agar tidak banyak kritikan dari orang lain.</p>', 0, '2022-02-05 05:13:39', '2022-02-05 05:13:39', NULL);
INSERT INTO `question_details` VALUES (36, 18, 'b', '<p>Saya perlu menerima masukan dari orang lain meski orang itu kerap mencela pekerjaan saya.</p>', 1, '2022-02-05 05:13:39', '2022-02-05 05:13:39', NULL);
INSERT INTO `question_details` VALUES (37, 19, 'a', '<p>Jika saya tidak mendapat insentif, maka wajar jika semangat bekerja berkurang.</p>', 0, '2022-02-05 05:14:12', '2022-02-05 05:14:12', NULL);
INSERT INTO `question_details` VALUES (38, 19, 'b', '<p>Semangat kerja saya tidak terpengaruh oleh adanya insentif.</p>', 1, '2022-02-05 05:14:12', '2022-02-05 05:14:12', NULL);
INSERT INTO `question_details` VALUES (39, 20, 'a', '<p>Saya masih dapat meluangkan waktu untuk mengikuti berita ringan dan aktual di sela-sela menyelesaikan tugas penting.</p>', 1, '2022-02-05 05:14:40', '2022-02-05 05:14:40', NULL);
INSERT INTO `question_details` VALUES (40, 20, 'b', '<p>Ketika sedang mengerjakan tugas penting membuat kebiasaan makan dan istirahat saya terganggu.</p>', 0, '2022-02-05 05:14:40', '2022-02-05 05:14:40', NULL);
INSERT INTO `question_details` VALUES (41, 21, 'a', '<p>Saya mencoba melontarkan humor untuk mencairkan suasana.</p>', 1, '2022-02-05 05:15:22', '2022-02-05 05:15:22', NULL);
INSERT INTO `question_details` VALUES (42, 21, 'b', '<p>Saya akan istirahat sejenak supaya menjadi lebih segar.</p>', 0, '2022-02-05 05:15:22', '2022-02-05 05:15:22', NULL);
INSERT INTO `question_details` VALUES (43, 22, 'a', '<p>Disiplin memang harus kaku agar aturan berjalan dengan benar.</p>', 1, '2022-02-05 05:15:52', '2022-02-05 05:15:52', NULL);
INSERT INTO `question_details` VALUES (44, 22, 'b', '<p>Disiplin yang kaku akan membuat suasana kerja menjadi tidak nyaman.</p>', 0, '2022-02-05 05:15:52', '2022-02-05 05:15:52', NULL);
INSERT INTO `question_details` VALUES (45, 23, 'a', '<p>Saya menunjukkan kedisiplinan dengan cara datang ke kantor tepat waktu.</p>', 0, '2022-02-05 05:16:21', '2022-02-05 05:16:21', NULL);
INSERT INTO `question_details` VALUES (46, 23, 'b', '<p>Ketika melihat kecelakaan lalu lintas saya menghentikan laju kendaraan saya dan menolong korban walaupun akibatnya saya datang terlambat ke kantor.</p>', 1, '2022-02-05 05:16:21', '2022-02-05 05:16:21', NULL);
INSERT INTO `question_details` VALUES (47, 24, 'a', '<p>Sering menyesali kesalahan-kesalahan yang pernah saya lakukan.</p>', 0, '2022-02-05 05:16:47', '2022-02-05 05:16:47', NULL);
INSERT INTO `question_details` VALUES (48, 24, 'b', '<p>Sering bercerita kepada orang lain serta menertawakan kesalahan yang pernah saya lakukan.</p>', 1, '2022-02-05 05:16:47', '2022-02-05 05:16:47', NULL);
INSERT INTO `question_details` VALUES (49, 25, 'a', '<p>Janji adalah hutang yang harus saya bayar.</p>', 1, '2022-02-05 05:17:17', '2022-02-05 05:17:17', NULL);
INSERT INTO `question_details` VALUES (50, 25, 'b', '<p>Banyak orang yang mengharapkan pernyataan kita dalam bentuk janji meskipun tidak berharap untuk dipenuhi.</p>', 0, '2022-02-05 05:17:17', '2022-02-05 05:17:17', NULL);
INSERT INTO `question_details` VALUES (51, 26, 'a', '<p>Saya tidak enak apabila berkata bohong karena sudah merupakan kebiasaan saya.</p>', 1, '2022-02-05 05:17:53', '2022-02-05 05:17:53', NULL);
INSERT INTO `question_details` VALUES (52, 26, 'b', '<p>Boleh saja berkata bohong asal tidak merugikan orang lain.</p>', 0, '2022-02-05 05:17:53', '2022-02-05 05:17:53', NULL);
INSERT INTO `question_details` VALUES (53, 27, 'a', '<p>Saya merasa kesal bila disuruh pimpinan mengerjakan tugas yang mendadak.</p>', 0, '2022-02-05 05:18:23', '2022-02-05 05:18:23', NULL);
INSERT INTO `question_details` VALUES (54, 27, 'b', '<p>Saya menolak bila disuruh mengerjakan tugas yang menurut saya tidak benar oleh atasan.</p>', 1, '2022-02-05 05:18:23', '2022-02-05 05:18:23', NULL);
INSERT INTO `question_details` VALUES (55, 28, 'a', '<p>Mengajak rekan senior untuk mencari cara bagaimana agar anggota bersedia melaksanakannya.&nbsp;</p>', 1, '2022-02-05 05:19:02', '2022-02-05 05:19:02', NULL);
INSERT INTO `question_details` VALUES (56, 28, 'b', '<p>Meminta anggota untuk fokus pada pekerjaan yang saya berikan.</p>', 0, '2022-02-05 05:19:02', '2022-02-05 05:19:02', NULL);
INSERT INTO `question_details` VALUES (57, 29, 'a', '<p>Saya akan memaksa orang lain untuk bekerja optimal.</p>', 0, '2022-02-05 05:19:35', '2022-02-05 05:19:35', NULL);
INSERT INTO `question_details` VALUES (58, 29, 'b', '<p>Saya akan membujuk orang lain dengan memberikan contoh.</p>', 1, '2022-02-05 05:19:35', '2022-02-05 05:19:35', NULL);
INSERT INTO `question_details` VALUES (59, 30, 'a', '<p>Saya akan menerima tugas walaupun harus dikerjakan saat itu juga.</p>', 1, '2022-02-05 05:20:04', '2022-02-05 05:20:04', NULL);
INSERT INTO `question_details` VALUES (60, 30, 'b', '<p>Saya merasa kecewa saat diberikan tugas yang harus dikerjakan dalam waktu cepat.</p>', 0, '2022-02-05 05:20:04', '2022-02-05 05:20:04', NULL);
INSERT INTO `question_details` VALUES (61, 31, 'a', '<p>Saya dapat mengatasi rasa tidak nyaman apabila dalam keadaan memaksa saya harus mengemukakan sesuatu yang tidak sebenarnya.</p>', 0, '2022-02-05 05:25:47', '2022-02-05 05:25:47', NULL);
INSERT INTO `question_details` VALUES (62, 31, 'b', '<p>Saya merasa tidak nyaman jika&nbsp; memberi keterangan palsu atau alasan-alasan palsu.</p>', 1, '2022-02-05 05:25:47', '2022-02-05 05:25:47', NULL);
INSERT INTO `question_details` VALUES (63, 32, 'a', '<p>Orang lain cenderung mudah memperkirakan apa reaksi atau tindakan saya terhadap suatu hal.</p>', 1, '2022-02-05 05:26:24', '2022-02-05 05:26:24', NULL);
INSERT INTO `question_details` VALUES (64, 32, 'b', '<p>Tindakan dan perilaku saya sulit ditebak orang lain.</p>', 0, '2022-02-05 05:26:24', '2022-02-05 05:26:24', NULL);
INSERT INTO `question_details` VALUES (65, 33, 'a', '<p>Menutupi semaksimal mungkin kekurangan yang kita miliki.</p>', 0, '2022-02-05 05:26:58', '2022-02-05 05:26:58', NULL);
INSERT INTO `question_details` VALUES (66, 33, 'b', '<p>Tidak masalah jika orang lain mengetahui kekurangan diri saya.</p>', 1, '2022-02-05 05:26:58', '2022-02-05 05:26:58', NULL);
INSERT INTO `question_details` VALUES (67, 34, 'a', '<p>Saya dapat bergaul dengan baik dan menikmati persahabatan dengan orang dari semua usia.</p>', 1, '2022-02-05 05:27:27', '2022-02-05 05:27:27', NULL);
INSERT INTO `question_details` VALUES (68, 34, 'b', '<p>Saya lebih suka berbicara dengan satu orang daripada berbicara dengan sekelompok orang.</p>', 0, '2022-02-05 05:27:27', '2022-02-05 05:27:27', NULL);
INSERT INTO `question_details` VALUES (69, 35, 'a', '<p>Lebih baik saya diolok-olok seperti robot daripada harus melanggar aturan kantor.&nbsp;</p>', 1, '2022-02-05 05:28:05', '2022-02-05 05:28:05', NULL);
INSERT INTO `question_details` VALUES (70, 35, 'b', '<p>Lebih baik saya sedikit melanggar aturan kantor daripada diolok-olok seperti robot.</p>', 0, '2022-02-05 05:28:05', '2022-02-05 05:28:05', NULL);
INSERT INTO `question_details` VALUES (71, 36, 'a', '<p>Memberdayakan dan tetap membina anggota sesuai keahliannya sekalipun karakter pribadinya sering menjengkelkan.</p>', 1, '2022-02-05 05:28:55', '2022-02-05 05:28:55', NULL);
INSERT INTO `question_details` VALUES (72, 36, 'b', '<p>Membina dan memberdayakan anggota yang mau bekerja saja, tanpa memaksa anggota lain yang enggan bekerja.</p>', 0, '2022-02-05 05:28:55', '2022-02-05 05:28:55', NULL);
INSERT INTO `question_details` VALUES (73, 37, 'a', '<p>Saya tahu resiko dari setiap keputusan yang saya ambil.</p>', 1, '2022-02-05 05:29:26', '2022-02-05 05:29:26', NULL);
INSERT INTO `question_details` VALUES (74, 37, 'b', '<p>Lebih baik tidak tahu daripada tahu namun merusak konsentrasi saya.</p>', 0, '2022-02-05 05:29:26', '2022-02-05 05:29:26', NULL);
INSERT INTO `question_details` VALUES (75, 38, 'a', '<p>Demi kelancaran tugas saya rela bekerja sendiri walaupun ada rekan kerja yang santai-santai.</p>', 1, '2022-02-05 05:29:57', '2022-02-05 05:29:57', NULL);
INSERT INTO `question_details` VALUES (76, 38, 'b', '<p>Saya tidak akan menyelesaikan tugas seorang diri, karena bagi saya pekerjaan harus diselesaikan bersama-sama.</p>', 0, '2022-02-05 05:29:57', '2022-02-05 05:29:57', NULL);
INSERT INTO `question_details` VALUES (77, 39, 'a', '<p>Saya lebih paham tentang diri saya sendiri sehingga jarang sekali saya merenungkan masukan dari orang lain.</p>', 0, '2022-02-05 05:30:28', '2022-02-05 05:30:28', NULL);
INSERT INTO `question_details` VALUES (78, 39, 'b', '<p>Tidak ada manusia yang sempurna, sehingga masukan orang tentang saya terkadang ada benarnya.</p>', 1, '2022-02-05 05:30:28', '2022-02-05 05:30:28', NULL);
INSERT INTO `question_details` VALUES (79, 40, 'a', '<p>Saat semua fakta dan data yang tersaji sudah lengkap namun menurut saya belum cukup meyakinkan, saya cenderung memilih menggunakan insting saya untuk membuat keputusan.</p>', 0, '2022-02-05 05:31:00', '2022-02-05 05:31:00', NULL);
INSERT INTO `question_details` VALUES (80, 40, 'b', '<p>Insting hanya digunakan pada saat saat mendesak, namun tetap saja fakta yang lengkap merupakan pedoman utama.</p>', 1, '2022-02-05 05:31:00', '2022-02-05 05:31:00', NULL);
INSERT INTO `question_details` VALUES (81, 41, 'a', '<p>Saya kurang berani saat menyampaikan informasi yang berkaitan dengan kelemahan pimpinan.</p>', 0, '2022-02-05 06:52:16', '2022-02-05 06:52:16', NULL);
INSERT INTO `question_details` VALUES (82, 41, 'b', '<p>Sering kali saya diminta untuk mengkritisi kepemimpinan atasan.&nbsp;</p>', 1, '2022-02-05 06:52:16', '2022-02-05 06:52:16', NULL);
INSERT INTO `question_details` VALUES (83, 42, 'a', '<p>Dalam kerja tim, setiap anggota memiliki tanggung jawab tugasnya masing-masing sehingga tidak perlu meminta dan menerima pertolongan dari anggota lainnya.&nbsp;</p>', 0, '2022-02-05 06:52:47', '2022-02-05 06:52:47', NULL);
INSERT INTO `question_details` VALUES (84, 42, 'b', '<p>Walaupun semua memiliki porsi tugasnya masing-masing tidak ada salahnya membantu anggota lainnya.</p>', 1, '2022-02-05 06:52:47', '2022-02-05 06:52:47', NULL);
INSERT INTO `question_details` VALUES (85, 43, 'a', '<p>Saya berusaha membuktikan bahwa usulan yang saya sampaikan benar dengan mempraktekkan dalam kegiatan sehari-hari.</p>', 1, '2022-02-05 06:53:23', '2022-02-05 06:53:23', NULL);
INSERT INTO `question_details` VALUES (86, 43, 'b', '<p>Saya yakin dengan kebenaran usulan saya sehingga tidak perlu untuk dibuktikan.&nbsp;</p>', 0, '2022-02-05 06:53:23', '2022-02-05 06:53:23', NULL);
INSERT INTO `question_details` VALUES (87, 44, 'a', '<p>Gagal merencanakan artinya merencanakan kegagalan.</p>', 1, '2022-02-05 06:53:53', '2022-02-05 06:53:53', NULL);
INSERT INTO `question_details` VALUES (88, 44, 'b', '<p>Gagal merencanakan bukan berarti merencanakan kegagalan.</p>', 0, '2022-02-05 06:53:53', '2022-02-05 06:53:53', NULL);
INSERT INTO `question_details` VALUES (89, 45, 'a', '<p>Memilih bersikap jujur meskipun terkadang dianggap merugikan orang lain.</p>', 1, '2022-02-05 06:54:23', '2022-02-05 06:54:23', NULL);
INSERT INTO `question_details` VALUES (90, 45, 'b', '<p>Sikap jujur cenderung rentan mendatangkan kerugian bagi diri sendiri, misalnya akan mudah diperdaya orang.</p>', 0, '2022-02-05 06:54:23', '2022-02-05 06:54:23', NULL);
INSERT INTO `question_details` VALUES (91, 46, 'a', '<p>Saya lebih senang mengikuti kemauan rekan saya karena merasa tidak enak jika menolaknya.</p>', 0, '2022-02-05 06:54:55', '2022-02-05 06:54:55', NULL);
INSERT INTO `question_details` VALUES (92, 46, 'b', '<p>Sekali saya menolak kemauan rekan, maka seterusnya saya pun akan menolak untuk hal yang sama.</p>', 1, '2022-02-05 06:54:55', '2022-02-05 06:54:55', NULL);
INSERT INTO `question_details` VALUES (93, 47, 'a', '<p>Saya baru menyadari kesalahan saya ketika mendapat masukan dari orang lain.</p>', 0, '2022-02-05 06:55:26', '2022-02-05 06:55:26', NULL);
INSERT INTO `question_details` VALUES (94, 47, 'b', '<p>Seringkali apa yang telah saya rencanakan dapat terlaksana, meski adakalanya tidak sesempurna yang saya harapkan.</p>', 1, '2022-02-05 06:55:26', '2022-02-05 06:55:26', NULL);
INSERT INTO `question_details` VALUES (95, 48, 'a', '<p>Seringnya saya bertemu teman saya menambah akrab hubungan kami.</p>', 0, '2022-02-05 06:55:59', '2022-02-05 06:55:59', NULL);
INSERT INTO `question_details` VALUES (96, 48, 'b', '<p>Seringnya saya bertemu teman saya menambah pemahaman tentang pribadinya.</p>', 1, '2022-02-05 06:55:59', '2022-02-05 06:55:59', NULL);
INSERT INTO `question_details` VALUES (97, 49, 'a', '<p>Saya tidak menyukai pekerjaan yang memiliki aturan baku yang menghambat kreatifitas.</p>', 0, '2022-02-05 06:56:28', '2022-02-05 06:56:28', NULL);
INSERT INTO `question_details` VALUES (98, 49, 'b', '<p>Saya terbiasa bekerja dengan aturan-aturan dan prosedur yang sudah jelas.</p>', 1, '2022-02-05 06:56:28', '2022-02-05 06:56:28', NULL);
INSERT INTO `question_details` VALUES (99, 50, 'a', '<p>Saya akan menggunakan cara yang sama dalam bertegur sapa dengan orang yang baru saya jumpai di gedung pertemuan.</p>', 1, '2022-02-05 06:56:57', '2022-02-05 06:56:57', NULL);
INSERT INTO `question_details` VALUES (100, 50, 'b', '<p>Saya akan menggunakan cara yang berbeda-beda dalam bertegur sapa dengan orang yang baru saya jumpai, sesuai dengan kesan yang saya terima.</p>', 0, '2022-02-05 06:56:57', '2022-02-05 06:56:57', NULL);
INSERT INTO `question_details` VALUES (101, 51, 'a', '<p>Dalam situasi yang tidak menentu saya akan menunda keinginan-keinginan materi yang berkaitan dengan peran sosial.</p>', 1, '2022-02-05 06:57:59', '2022-02-05 06:57:59', NULL);
INSERT INTO `question_details` VALUES (102, 51, 'b', '<p>Dalam situasi yang tidak menentu saya tetap memenuhi keinginan-keinginan materi untuk kepentingan peran sosial.</p>', 0, '2022-02-05 06:57:59', '2022-02-05 06:57:59', NULL);
INSERT INTO `question_details` VALUES (103, 52, 'a', '<p>Saya mengatakan bahwa itu kesalahan saya.&nbsp;</p>', 1, '2022-02-05 06:58:45', '2022-02-05 06:58:45', NULL);
INSERT INTO `question_details` VALUES (104, 52, 'b', '<p>Saya menjelaskan kejadian yang sebenarnya.</p>', 0, '2022-02-05 06:58:45', '2022-02-05 06:58:45', NULL);
INSERT INTO `question_details` VALUES (105, 53, 'a', '<p>Keputusan yang saya ambil banyak benarnya karena berdasarkan masukan dari orang lain</p>', 1, '2022-02-05 06:59:14', '2022-02-05 06:59:14', NULL);
INSERT INTO `question_details` VALUES (106, 53, 'b', '<p>Masukan dari orang lain saya abaikan karena tidak sesuai dengan teori yang saya yakini.</p>', 0, '2022-02-05 06:59:14', '2022-02-05 06:59:14', NULL);
INSERT INTO `question_details` VALUES (107, 54, 'a', '<p>Mudah menilai seseorang dengan obyektif asalkan mau.</p>', 1, '2022-02-05 06:59:42', '2022-02-05 06:59:42', NULL);
INSERT INTO `question_details` VALUES (108, 54, 'b', '<p>Sulit menilai seseorang secara obyektif.</p>', 0, '2022-02-05 06:59:42', '2022-02-05 06:59:42', NULL);
INSERT INTO `question_details` VALUES (109, 55, 'a', '<p>Dalam forum diskusi, saya cenderung mempertimbangkan aspek peserta diskusi untuk menyampaikan pendapat.</p>', 0, '2022-02-05 07:00:12', '2022-02-05 07:00:12', NULL);
INSERT INTO `question_details` VALUES (110, 55, 'b', '<p>Dalam forum diskusi, saya tidak perlu mempertimbangkan siapa yang menjadi peserta diskusi untuk menyampaikan berbagai informasi.</p>', 1, '2022-02-05 07:00:12', '2022-02-05 07:00:12', NULL);
INSERT INTO `question_details` VALUES (111, 56, 'a', '<p>Saya membiasakan anggota membuat rencana kegiatan individu agar target yang mereka inginkan dapat dicapai.</p>', 1, '2022-02-05 07:00:39', '2022-02-05 07:00:39', NULL);
INSERT INTO `question_details` VALUES (112, 56, 'b', '<p>Saya rasa tidak terlalu utama membuat rencana kerja karena pada akhirnya semuanya sering berubah.</p>', 0, '2022-02-05 07:00:39', '2022-02-05 07:00:39', NULL);
INSERT INTO `question_details` VALUES (113, 57, 'a', '<p>Tidak perlu mengulang pengarahan yang saya berikan apabila ada anggota yang masih belum mengerti karena salah mereka sendiri yang tidak konsentrasi mendengarkan instruksi saya.&nbsp;</p>', 0, '2022-02-05 07:01:09', '2022-02-05 07:01:09', NULL);
INSERT INTO `question_details` VALUES (114, 57, 'b', '<p>Saya selalu memikirkan cara-cara yang sesuai untuk meningkatkan semangat kerja masing-masing anggota saya.</p>', 1, '2022-02-05 07:01:09', '2022-02-05 07:01:09', NULL);
INSERT INTO `question_details` VALUES (115, 58, 'a', '<p>Saya cenderung sulit menolak ajakan teman, terutama teman seangkatan meskipun hal itu dapat mempengaruhi kebiasaan saya.</p>', 0, '2022-02-05 07:01:38', '2022-02-05 07:01:38', NULL);
INSERT INTO `question_details` VALUES (116, 58, 'b', '<p>Sekalipun itu teman baik seangkatan saya, jika ajakannya tidak sesuai dengan kebiasaan maka saya tetap akan menolak.</p>', 1, '2022-02-05 07:01:38', '2022-02-05 07:01:38', NULL);
INSERT INTO `question_details` VALUES (117, 59, 'a', '<p>Saya menilai sesuatu berdasarkan hal-hal yang saya amati.&nbsp;</p>', 1, '2022-02-05 07:02:14', '2022-02-05 07:02:14', NULL);
INSERT INTO `question_details` VALUES (118, 59, 'b', '<p>Saya menilai sesuatu berdasarkan kesan-kesan yang saya tangkap.</p>', 0, '2022-02-05 07:02:14', '2022-02-05 07:02:14', NULL);
INSERT INTO `question_details` VALUES (119, 60, 'a', '<p>Saya tidak sungkan meminta bantuan pada rekan, saat saya tidak sanggup melakukan sesuatu.</p>', 1, '2022-02-05 07:02:40', '2022-02-05 07:02:40', NULL);
INSERT INTO `question_details` VALUES (120, 60, 'b', '<p>Walaupun saya tidak sanggup melakukan sesuatu, saya merasa malu jika harus mengatakan pada orang lain apalagi minta bantuan.</p>', 0, '2022-02-05 07:02:40', '2022-02-05 07:02:40', NULL);
INSERT INTO `question_details` VALUES (121, 61, 'a', '<p>Saya menyampaikan hal tersebut karena anggota kurang bertanggung jawab.&nbsp;</p>', 0, '2022-02-05 07:04:46', '2022-02-05 07:04:46', NULL);
INSERT INTO `question_details` VALUES (122, 61, 'b', '<p>Sebagai pimpinan saya akan mempertanggungjawabkan pencapaian kinerja yang kurang.</p>', 1, '2022-02-05 07:04:46', '2022-02-05 07:04:46', NULL);
INSERT INTO `question_details` VALUES (123, 62, 'a', '<p>Saya merasa cemas dan khawatir jika anggota saya belum menyelesaikan pekerjaannya.</p>', 0, '2022-02-05 07:05:26', '2022-02-05 07:05:26', NULL);
INSERT INTO `question_details` VALUES (124, 62, 'b', '<p>Saya tetap menunggu pekerjaan bawahan yang belum selesai.</p>', 1, '2022-02-05 07:05:26', '2022-02-05 07:05:26', NULL);
INSERT INTO `question_details` VALUES (125, 63, 'a', '<p>Mendengarkan secara seksama apa yang diceritakan sebagai bentuk perhatian saya kepadanya.</p>', 0, '2022-02-05 07:06:02', '2022-02-05 07:06:02', NULL);
INSERT INTO `question_details` VALUES (126, 63, 'b', '<p>Mendengarkan secara seksama agar mengetahui keadaan diri teman saya tersebut.</p>', 1, '2022-02-05 07:06:02', '2022-02-05 07:06:02', NULL);
INSERT INTO `question_details` VALUES (127, 64, 'a', '<p>Saya tidak terbiasa membaca aturan yang berlaku, karena saya sudah terbiasa melakukan tugas tersebut.</p>', 0, '2022-02-05 07:06:29', '2022-02-05 07:06:29', NULL);
INSERT INTO `question_details` VALUES (128, 64, 'b', '<p>Sebelum memulai mengerjakan tugas saya terbiasa dengan membaca dan memahami aturan yang berlaku.</p>', 1, '2022-02-05 07:06:29', '2022-02-05 07:06:29', NULL);
INSERT INTO `question_details` VALUES (129, 65, 'a', '<p>Memberikan jawaban dan alasan yang dapat menyenangkan anggota.</p>', 0, '2022-02-05 07:07:04', '2022-02-05 07:07:04', NULL);
INSERT INTO `question_details` VALUES (130, 65, 'b', '<p>Ikut merasakan&nbsp;jika saya dalam posisi mereka.</p>', 1, '2022-02-05 07:07:04', '2022-02-05 07:07:04', NULL);
INSERT INTO `question_details` VALUES (131, 66, 'a', '<p>Sulit bagi saya jika ditanya tentang kelebihan dan kekurangan diri yang berkaitan dengan pekerjaan yang saya lakukan.&nbsp;</p>', 0, '2022-02-05 07:07:30', '2022-02-05 07:07:30', NULL);
INSERT INTO `question_details` VALUES (132, 66, 'b', '<p>Saya dapat mengukur kemampuan saya sendiri terhadap suatu pekerjaan yang dibebankan ke saya.</p>', 1, '2022-02-05 07:07:30', '2022-02-05 07:07:30', NULL);
INSERT INTO `question_details` VALUES (133, 67, 'a', '<p>Kadang-kadang komitmen yang sudah kita buat dapat berubah sesuai situasi dan kondisi.&nbsp;</p>', 0, '2022-02-05 07:07:55', '2022-02-05 07:07:55', NULL);
INSERT INTO `question_details` VALUES (134, 67, 'b', '<p>Ketika saya berkomitmen, berarti saya harus melaksanakannya.</p>', 1, '2022-02-05 07:07:55', '2022-02-05 07:07:55', NULL);
INSERT INTO `question_details` VALUES (135, 68, 'a', '<p>Saya menampilkan diri sesuai harapan pimpinan agar mendapat penilaian yang baik.</p>', 0, '2022-02-05 07:08:19', '2022-02-05 07:08:19', NULL);
INSERT INTO `question_details` VALUES (136, 68, 'b', '<p>Saya dianggap sebagai orang yang polos oleh pimpinan dan teman-teman saya.</p>', 1, '2022-02-05 07:08:19', '2022-02-05 07:08:19', NULL);
INSERT INTO `question_details` VALUES (137, 69, 'a', '<p>Saya mendapatkan rasa puas atas pekerjaan yang saya lakukan berdasarkan penilaian saya pribadi atas hasil kerja saya.&nbsp;</p>', 1, '2022-02-05 07:08:47', '2022-02-05 07:08:47', NULL);
INSERT INTO `question_details` VALUES (138, 69, 'b', '<p>Saya mendapat rasa puas atas pekerjaan yang saya lakukan berdasarkan penilaian baik dari orang lain atas hasil kerja saya.</p>', 0, '2022-02-05 07:08:47', '2022-02-05 07:08:47', NULL);
INSERT INTO `question_details` VALUES (139, 70, 'a', '<p>Saya tidak bisa menerima perlakuan orang lain yang selalu menolak usulan saya tanpa pernah mau mendengarkan penjelasan dari saya.</p>', 0, '2022-02-05 07:09:10', '2022-02-05 07:09:10', NULL);
INSERT INTO `question_details` VALUES (140, 70, 'b', '<p>Saya berusaha untuk selalu&nbsp;meyakinkan usulan saya ke orang lain&nbsp;meskipun harus berulang kali.</p>', 1, '2022-02-05 07:09:10', '2022-02-05 07:09:10', NULL);
INSERT INTO `question_details` VALUES (141, 71, 'a', '<p>Adanya beban target yang berat, menyebabkan tim yang saya pimpin menjadi kurang fokus dalam menyelesaikan tugas.</p>', 0, '2022-02-05 07:15:08', '2022-02-05 07:15:08', NULL);
INSERT INTO `question_details` VALUES (142, 71, 'b', '<p>Adanya target yang tinggi membuat tim yang saya pimpin menjadi lebih fokus pada penyelesaian tugas.</p>', 1, '2022-02-05 07:15:08', '2022-02-05 07:15:08', NULL);
INSERT INTO `question_details` VALUES (143, 72, 'a', '<p>Adakalanya saya sungkan untuk menyampaikan temuan kepada pimpinan karena bisa merugikan orang lain.</p>', 0, '2022-02-05 07:15:33', '2022-02-05 07:15:33', NULL);
INSERT INTO `question_details` VALUES (144, 72, 'b', '<p>Saya tetap berusaha menyampaikan temuan kepada pimpinan meskipun menanggung banyak konsekuensi sosial dari rekan sekerja saya.</p>', 1, '2022-02-05 07:15:33', '2022-02-05 07:15:33', NULL);
INSERT INTO `question_details` VALUES (145, 73, 'a', '<p>Dalam bertindak saya sering mempertimbangkan fakta yang ada.</p>', 1, '2022-02-05 07:15:59', '2022-02-05 07:15:59', NULL);
INSERT INTO `question_details` VALUES (146, 73, 'b', '<p>Saya banyak bertindak berdasarkan apa yang saya yakini.</p>', 0, '2022-02-05 07:15:59', '2022-02-05 07:15:59', NULL);
INSERT INTO `question_details` VALUES (147, 74, 'a', '<p>Saya hanya mendengarkan masukan dari orang yang sepaham dengan saya.</p>', 0, '2022-02-05 07:16:29', '2022-02-05 07:16:29', NULL);
INSERT INTO `question_details` VALUES (148, 74, 'b', '<p>Saya mau mendengarkan masukan dari semua orang termasuk dari orang yang tidak sepaham dengan saya.</p>', 1, '2022-02-05 07:16:29', '2022-02-05 07:16:29', NULL);
INSERT INTO `question_details` VALUES (149, 75, 'a', '<p>Sebisa mungkin saya akan meminta untuk menundanya karena hari libur adalah hari keluarga.</p>', 0, '2022-02-05 07:17:26', '2022-02-05 07:17:26', NULL);
INSERT INTO `question_details` VALUES (150, 75, 'b', '<p>Saya akan segera melaksanakan tugas itu meskipun keluarga menjadi kecewa.</p>', 1, '2022-02-05 07:17:26', '2022-02-05 07:17:26', NULL);
INSERT INTO `question_details` VALUES (151, 76, 'a', '<p>Mengerjakan apa yang sudah saya rencanakan.</p>', 1, '2022-02-05 07:17:49', '2022-02-05 07:17:49', NULL);
INSERT INTO `question_details` VALUES (152, 76, 'b', '<p>Mengerjakan apa yang saya anggap bisa kerjakan.</p>', 0, '2022-02-05 07:17:49', '2022-02-05 07:17:49', NULL);
INSERT INTO `question_details` VALUES (153, 77, 'a', '<p>Dalam menghadapi orang yang sudah saya kenal saya dapat bebas menyatakan perasaan-perasaan tanpa khawatir atas kejengkelannya, karena saya tahu cara meredakan kejengkelannya.</p>', 1, '2022-02-05 07:18:16', '2022-02-05 07:18:16', NULL);
INSERT INTO `question_details` VALUES (154, 77, 'b', '<p>Dalam menghadapi orang yang sudah saya kenal saya hati-hati agar tidak menyinggung hal-hal yang baginya sensitif.</p>', 0, '2022-02-05 07:18:16', '2022-02-05 07:18:16', NULL);
INSERT INTO `question_details` VALUES (155, 78, 'a', '<p>Saya setuju setiap orang harus membuat ketentuan-ketentuan untuk diri sendiri dan mengikuti sepenuhnya ketentuannya itu.&nbsp;</p>', 1, '2022-02-05 07:18:41', '2022-02-05 07:18:41', NULL);
INSERT INTO `question_details` VALUES (156, 78, 'b', '<p>Saya berpandangan orang tidak perlu mengekang diri sendiri dengan membuat ketentuan-ketentuan yang harus dipatuhinya.</p>', 0, '2022-02-05 07:18:41', '2022-02-05 07:18:41', NULL);
INSERT INTO `question_details` VALUES (157, 79, 'a', '<p>Saya memilih diam saat ada rekan seangkatan yang bermasalah karena jika membantu dapat terkena akibatnya.</p>', 0, '2022-02-05 07:19:04', '2022-02-05 07:19:04', NULL);
INSERT INTO `question_details` VALUES (158, 79, 'b', '<p>Saya akan menghubungi rekan seangkatan yang lain saat ada rekan seangkatan yang bermasalah untuk bersama-sama membantunya</p>', 1, '2022-02-05 07:19:04', '2022-02-05 07:19:04', NULL);
INSERT INTO `question_details` VALUES (159, 80, 'a', '<p>Saya tahu tentang potensi dan kemampuan diri saya.</p>', 1, '2022-02-05 07:19:28', '2022-02-05 07:19:28', NULL);
INSERT INTO `question_details` VALUES (160, 80, 'b', '<p>Saya rasa diri saya baik-baik saja sehingga tidak ada yang salah dengan perilaku saya.</p>', 0, '2022-02-05 07:19:28', '2022-02-05 07:19:28', NULL);
INSERT INTO `question_details` VALUES (161, 81, 'a', '<p>Saya selalu menjaga perkataan saya supaya tidak menyakiti hati orang lain.</p>', 1, '2022-02-05 07:39:06', '2022-02-05 07:39:06', NULL);
INSERT INTO `question_details` VALUES (162, 81, 'b', '<p>Ketika saya marah kadang perkataan saya menyakiti orang lain.</p>', 0, '2022-02-05 07:39:06', '2022-02-05 07:39:06', NULL);
INSERT INTO `question_details` VALUES (163, 82, 'a', '<p>Seberat apapun hukumannya, saya akan mempertanggungjawabkan kesalahan yang sudah saya lakukan.</p>', 1, '2022-02-05 07:39:36', '2022-02-05 07:39:36', NULL);
INSERT INTO `question_details` VALUES (164, 82, 'b', '<p>Saya akan mencari alasan pembenar atas kesalahan yang telah saya lakukan.</p>', 0, '2022-02-05 07:39:36', '2022-02-05 07:39:36', NULL);
INSERT INTO `question_details` VALUES (165, 83, 'a', '<p>Saya merasa puas dengan keadaan diri saya saat ini.</p>', 0, '2022-02-05 07:40:03', '2022-02-05 07:40:03', NULL);
INSERT INTO `question_details` VALUES (166, 83, 'b', '<p>Saya selalu ingin lebih baik dari kondisi saya sekarang.</p>', 1, '2022-02-05 07:40:03', '2022-02-05 07:40:03', NULL);
INSERT INTO `question_details` VALUES (167, 84, 'a', '<p>Saya sering ditunjuk oleh rekan kerja untuk menyampaikan ide penting kepada pimpinan.&nbsp;</p>', 1, '2022-02-05 07:40:31', '2022-02-05 07:40:31', NULL);
INSERT INTO `question_details` VALUES (168, 84, 'b', '<p>Seringkali saya merasa bingung bagaimana caranya meyakinkan atasan&nbsp; agar menyetujui usulan saya.</p>', 0, '2022-02-05 07:40:31', '2022-02-05 07:40:31', NULL);
INSERT INTO `question_details` VALUES (169, 85, 'a', '<p>Saya merasa tidak enak jika harus menceritakan kesuksesan saya kepada rekan yang sedang mempunyai masalah serupa dengan masalah saya dulu.</p>', 0, '2022-02-05 07:40:57', '2022-02-05 07:40:57', NULL);
INSERT INTO `question_details` VALUES (170, 85, 'b', '<p>Saya seringkali menyemangati teman yang sedang mempunyai masalah dengan menceritakan kesuksesan saya.</p>', 1, '2022-02-05 07:40:57', '2022-02-05 07:40:57', NULL);
INSERT INTO `question_details` VALUES (171, 86, 'a', '<p>Saya&nbsp;sudah nyaman dengan pekerjaan yang tidak menguras energi dan pikiran.&nbsp;</p>', 0, '2022-02-05 07:41:23', '2022-02-05 07:41:23', NULL);
INSERT INTO `question_details` VALUES (172, 86, 'b', '<p>Saya senang diberikan tugas yang&nbsp;berbeda walaupun memerlukan tambahan waktu.</p>', 1, '2022-02-05 07:41:23', '2022-02-05 07:41:23', NULL);
INSERT INTO `question_details` VALUES (173, 87, 'a', '<p>Berbohong demi kebaikan tidak apa-apa.</p>', 0, '2022-02-05 07:41:47', '2022-02-05 07:41:47', NULL);
INSERT INTO `question_details` VALUES (174, 87, 'b', '<p>Saya terbiasa bersikap jujur dan apa adanya.</p>', 1, '2022-02-05 07:41:47', '2022-02-05 07:41:47', NULL);
INSERT INTO `question_details` VALUES (175, 88, 'a', '<p>Kadang-kadang komitmen yang sudah saya buat dapat berubah sesuai situasi dan kondisi.</p>', 0, '2022-02-05 07:42:15', '2022-02-05 07:42:15', NULL);
INSERT INTO `question_details` VALUES (176, 88, 'b', '<p>Ketika saya berkomitmen, berarti saya harus memenuhi komitmen tersebut.</p>', 1, '2022-02-05 07:42:15', '2022-02-05 07:42:15', NULL);
INSERT INTO `question_details` VALUES (177, 89, 'a', '<p>Saya suka melihat pameran mobil mewah terbaru dan mahal walaupun saya menyadari tidak bisa memilikinya.&nbsp;&nbsp;</p>', 1, '2022-02-05 07:42:37', '2022-02-05 07:42:37', NULL);
INSERT INTO `question_details` VALUES (178, 89, 'b', '<p>Saya suka melihat pameran mobil mewah terbaru dan mahal dan saya yakin bisa membelinya dengan cara kredit.</p>', 0, '2022-02-05 07:42:37', '2022-02-05 07:42:37', NULL);
INSERT INTO `question_details` VALUES (179, 90, 'a', '<p>Terkadang saya sulit untuk larut dalam kesedihan orang lain di saat suasana hati saya sedang tidak baik.</p>', 0, '2022-02-05 07:42:59', '2022-02-05 07:42:59', NULL);
INSERT INTO `question_details` VALUES (180, 90, 'b', '<p>Tidak sulit bagi saya untuk membayangkan bagaimana seandainya saya berada di posisi orang lain, baik saat senang maupun sedih.</p>', 1, '2022-02-05 07:42:59', '2022-02-05 07:42:59', NULL);
INSERT INTO `question_details` VALUES (181, 91, 'a', '<p>Saya menjalani saja hal-hal yang sudah menjadi tugas saya.&nbsp;</p>', 0, '2022-02-05 07:43:25', '2022-02-05 07:43:25', NULL);
INSERT INTO `question_details` VALUES (182, 91, 'b', '<p>Saya terbiasa membuat jadwal kegiatan yang harus saya lakukan.</p>', 1, '2022-02-05 07:43:25', '2022-02-05 07:43:25', NULL);
INSERT INTO `question_details` VALUES (183, 92, 'a', '<p>Saya biasa bergurau disaat suasana sedang santai bersama anggota saya.</p>', 1, '2022-02-05 07:43:48', '2022-02-05 07:43:48', NULL);
INSERT INTO `question_details` VALUES (184, 92, 'b', '<p>Saya tergolong orang yang serius dan jarang bergurau dengan anggota saya.</p>', 0, '2022-02-05 07:43:48', '2022-02-05 07:43:48', NULL);
INSERT INTO `question_details` VALUES (185, 93, 'a', '<p>Menjelasan bahwa hal tersebut sudah menjadi keputusan kami .</p>', 0, '2022-02-05 07:44:18', '2022-02-05 07:44:18', NULL);
INSERT INTO `question_details` VALUES (186, 93, 'b', '<p>Mendengarkan alasan-alasan protesnya dan jika diperlukan memperbaiki pekerjaan tersebut.</p>', 1, '2022-02-05 07:44:18', '2022-02-05 07:44:18', NULL);
INSERT INTO `question_details` VALUES (187, 94, 'a', '<p>Saya mau dipersalahkan untuk suatu perbuatan demi teman-teman.&nbsp;</p>', 1, '2022-02-05 07:44:40', '2022-02-05 07:44:40', NULL);
INSERT INTO `question_details` VALUES (188, 94, 'b', '<p>Orang yang bersalah harus dicari untuk mempertanggungjawabkan kesalahannya.</p>', 0, '2022-02-05 07:44:40', '2022-02-05 07:44:40', NULL);
INSERT INTO `question_details` VALUES (189, 95, 'a', '<p>Tampilkan dirimu yang terbaik dan tutupilah kelemahanmu, citra diri akan naik.</p>', 0, '2022-02-05 07:45:01', '2022-02-05 07:45:01', NULL);
INSERT INTO `question_details` VALUES (190, 95, 'b', '<p>Tampilkan diri apa adanya, tidak ada ruginya orang lain mengetahui kekurangan maupun kelebihan kita.</p>', 1, '2022-02-05 07:45:01', '2022-02-05 07:45:01', NULL);
INSERT INTO `question_details` VALUES (191, 96, 'a', '<p>Walaupun berat, saya tetap akan mengatakan yang sebenarnya.</p>', 1, '2022-02-05 07:45:23', '2022-02-05 07:45:23', NULL);
INSERT INTO `question_details` VALUES (192, 96, 'b', '<p>Dalam berbicara, saya akan menjaga perasaan orang lain walaupun bukan yang sebenarnya.</p>', 0, '2022-02-05 07:45:23', '2022-02-05 07:45:23', NULL);
INSERT INTO `question_details` VALUES (193, 97, 'a', '<p>Kehati-hatian saya dalam menyampaikan informasi cenderung untuk menghindari kritikan atau rusaknya hubungan dengan orang lain.</p>', 0, '2022-02-05 07:45:45', '2022-02-05 07:45:45', NULL);
INSERT INTO `question_details` VALUES (194, 97, 'b', '<p>Saya tidak perlu mempertimbangkan perasaan orang lain saat menyampaikan informasi yang saya yakini kebenarannya.</p>', 1, '2022-02-05 07:45:45', '2022-02-05 07:45:45', NULL);
INSERT INTO `question_details` VALUES (195, 98, 'a', '<p>Hasil kerja akan jauh lebih optimal jika pekerjaan dilakukan seorang diri dibandingkan secara berkelompok.&nbsp;</p>', 0, '2022-02-05 07:46:07', '2022-02-05 07:46:07', NULL);
INSERT INTO `question_details` VALUES (196, 98, 'b', '<p>Hasil kerja akan jauh lebih optimal jika pekerjaan itu dilakukan berkelompok dibandingkan secara seorang diri.</p>', 1, '2022-02-05 07:46:07', '2022-02-05 07:46:07', NULL);
INSERT INTO `question_details` VALUES (197, 99, 'a', '<p>Dalam bekerja memaksa orang lain agar mau membantu saya, jauh lebih baik daripada harus menyenangkan hatinya namun tidak tulus.&nbsp;</p>', 0, '2022-02-05 07:46:27', '2022-02-05 07:46:27', NULL);
INSERT INTO `question_details` VALUES (198, 99, 'b', '<p>Dalam rapat di kantor, saya selalu berusaha meyakinkan kebenaran ide-ide saya dengan berbagai bukti.</p>', 1, '2022-02-05 07:46:27', '2022-02-05 07:46:27', NULL);
INSERT INTO `question_details` VALUES (199, 100, 'a', '<p>Saya menyiapkan baju kerja yang dipakai besok pada malam harinya sebelum tidur.</p>', 1, '2022-02-05 07:46:51', '2022-02-05 07:46:51', NULL);
INSERT INTO `question_details` VALUES (200, 100, 'b', '<p>Saya terbiasa mendadak melakukan aktifitas dalam kehidupan sehari-hari.</p>', 0, '2022-02-05 07:46:51', '2022-02-05 07:46:51', NULL);
INSERT INTO `question_details` VALUES (201, 101, 'a', '<p>Dalam berbicara saya akan menunjukkan hal-hal yang baik.</p>', 0, '2022-02-05 07:47:14', '2022-02-05 07:47:14', NULL);
INSERT INTO `question_details` VALUES (202, 101, 'b', '<p>Saya berusaha agar perkataan dan perbuatan selalu sejalan.</p>', 1, '2022-02-05 07:47:14', '2022-02-05 07:47:14', NULL);
INSERT INTO `question_details` VALUES (203, 102, 'a', '<p>Kebijakan yang sudah diputuskan saya jalankan sesuai kondisi yang dihadapi di lapangan.</p>', 0, '2022-02-05 07:47:36', '2022-02-05 07:47:36', NULL);
INSERT INTO `question_details` VALUES (204, 102, 'b', '<p>Jika saya telah memutuskan suatu kebijakan maka saya akan menjalankan secara konsekuen.</p>', 1, '2022-02-05 07:47:36', '2022-02-05 07:47:36', NULL);
INSERT INTO `question_details` VALUES (205, 103, 'a', '<p>Saya sering secara tidak sadar mampu membuat suatu keberhasilan.</p>', 0, '2022-02-05 07:47:58', '2022-02-05 07:47:58', NULL);
INSERT INTO `question_details` VALUES (206, 103, 'b', '<p>Keberhasilan saya selama ini memang berkaitan lansung dengan kemampuan saya.</p>', 1, '2022-02-05 07:47:58', '2022-02-05 07:47:58', NULL);
INSERT INTO `question_details` VALUES (207, 104, 'a', '<p>Meskipun sudah cukup dekat dengan teman-teman, tetapi saya masih merasa belum cukup mengenal mereka.</p>', 0, '2022-02-05 07:48:29', '2022-02-05 07:48:29', NULL);
INSERT INTO `question_details` VALUES (208, 104, 'b', '<p>Meski jarang bertemu saya cukup memahami kepribadian semua teman dekat saya.</p>', 1, '2022-02-05 07:48:29', '2022-02-05 07:48:29', NULL);
INSERT INTO `question_details` VALUES (209, 105, 'a', '<p>Saya mengandalkan ingatan atas rencana-rencana kegiatan yang saya lakukan.</p>', 0, '2022-02-05 07:48:50', '2022-02-05 07:48:50', NULL);
INSERT INTO `question_details` VALUES (210, 105, 'b', '<p>Saya terbiasa mencatat kegiatan-kegiatan yang akan saya lakukan.&nbsp;&nbsp;</p>', 1, '2022-02-05 07:48:50', '2022-02-05 07:48:50', NULL);
INSERT INTO `question_details` VALUES (211, 106, 'a', '<p>Terkadang masih ada saja anggota saya di Satker lama yang menelpon meskipun sekedar menanyakan kabar kesehatan saya.</p>', 1, '2022-02-05 07:49:10', '2022-02-05 07:49:10', NULL);
INSERT INTO `question_details` VALUES (212, 106, 'b', '<p>Saya rasa tidak terlalu penting menerima kabar dari anggota lama karena pekerjaan jauh lebih&nbsp; penting.</p>', 0, '2022-02-05 07:49:10', '2022-02-05 07:49:10', NULL);
INSERT INTO `question_details` VALUES (213, 107, 'a', '<p>Saya akan memberikan penjelasan yang masuk akal agar atasan tidak memarahi saya.</p>', 0, '2022-02-05 07:49:47', '2022-02-05 07:49:47', NULL);
INSERT INTO `question_details` VALUES (214, 107, 'b', '<p>Saya akan berusaha memperbaiki kebiasaan penyelesaian tugas.</p>', 1, '2022-02-05 07:49:47', '2022-02-05 07:49:47', NULL);
INSERT INTO `question_details` VALUES (215, 108, 'a', '<p>Saya akan menelponnya dan mengatakan pada penagih untuk bersabar.</p>', 0, '2022-02-05 07:50:19', '2022-02-05 07:50:19', NULL);
INSERT INTO `question_details` VALUES (216, 108, 'b', '<p>Saya akan membayar hutangnya.</p>', 1, '2022-02-05 07:50:19', '2022-02-05 07:50:19', NULL);
INSERT INTO `question_details` VALUES (217, 109, 'a', '<p>Selalu yakin akan kemampuan yang saya miliki.</p>', 0, '2022-02-05 07:50:47', '2022-02-05 07:50:47', NULL);
INSERT INTO `question_details` VALUES (218, 109, 'b', '<p>Tidak segan-segan untuk meminta saran atau pendapat orang lain yang saya anggap menguasai permasalahan tersebut.</p>', 1, '2022-02-05 07:50:47', '2022-02-05 07:50:47', NULL);
INSERT INTO `question_details` VALUES (219, 110, 'a', '<p>Saya mempercayai hanya kepada hal yang saya anggup benar.</p>', 0, '2022-02-05 07:51:10', '2022-02-05 07:51:10', NULL);
INSERT INTO `question_details` VALUES (220, 110, 'b', '<p>Saya percaya bahwa hal yang benar harus berdasarkan fakta-fakta atau informasi yang ada</p>', 1, '2022-02-05 07:51:10', '2022-02-05 07:51:10', NULL);
INSERT INTO `question_details` VALUES (221, 111, 'a', '<p>Saya dikenal sebagai pimpinan yang&nbsp; tegas dalam menyampaikan pendapat kepada bawahan.</p>', 1, '2022-02-05 07:51:35', '2022-02-05 07:51:35', NULL);
INSERT INTO `question_details` VALUES (222, 111, 'b', '<p>Sebagai pimpinan saya akan merasa lebih bijak jika menyampaikan pendapat dengan tetap mempertimbangkan aspek perasaan bawahan.</p>', 0, '2022-02-05 07:51:35', '2022-02-05 07:51:35', NULL);
INSERT INTO `question_details` VALUES (223, 112, 'a', '<p>Tidak ada salahnya sebagai pimpinan harus mau mendampingi anggota bekerja sekalipun untuk pekerjaan yang ringan.</p>', 1, '2022-02-05 07:51:56', '2022-02-05 07:51:56', NULL);
INSERT INTO `question_details` VALUES (224, 112, 'b', '<p>Saya rasa jaman sudah berubah sehingga pimpinan yang seharusnya mengikuti irama kerja anggota.</p>', 0, '2022-02-05 07:51:56', '2022-02-05 07:51:56', NULL);
INSERT INTO `question_details` VALUES (225, 113, 'a', '<p>Menyesuaikan saja sesuai prinsip mengalir seperti air.</p>', 0, '2022-02-05 07:52:38', '2022-02-05 07:52:38', NULL);
INSERT INTO `question_details` VALUES (226, 113, 'b', '<p>Meskipun berat, pasti bisa&nbsp; melakukannya.</p>', 1, '2022-02-05 07:52:38', '2022-02-05 07:52:38', NULL);
INSERT INTO `question_details` VALUES (227, 114, 'a', '<p>Saya menyampaikan sesuatu berdasarkan apa yang saya rasakan dan pikirkan tanpa harus mempertimbangakn perasaan orang lain.</p>', 1, '2022-02-05 07:53:28', '2022-02-05 07:53:28', NULL);
INSERT INTO `question_details` VALUES (228, 114, 'b', '<p>Saya sangat setuju dalam&nbsp; menyampaikan sesuatu harus berdasarkan pertimbangan logis untuk menjaga hubungan.</p>', 0, '2022-02-05 07:53:28', '2022-02-05 07:53:28', NULL);
INSERT INTO `question_details` VALUES (229, 115, 'a', '<p>Saya banyak menggunakan perasaan saya dalam menilai orang.</p>', 0, '2022-02-05 07:53:49', '2022-02-05 07:53:49', NULL);
INSERT INTO `question_details` VALUES (230, 115, 'b', '<p>Dalam menilai orang lain harus berdasarkan fakta yang ada.</p>', 1, '2022-02-05 07:53:49', '2022-02-05 07:53:49', NULL);
INSERT INTO `question_details` VALUES (231, 116, 'a', '<p>Saya pertimbangkan saran-saran orang lain meskipun bertentangan dengan konsep yang saya buat.</p>', 1, '2022-02-05 07:54:09', '2022-02-05 07:54:09', NULL);
INSERT INTO `question_details` VALUES (232, 116, 'b', '<p>Saya dengarkan saran orang lain, tetapi tetap menggunakan konsep sendiri yang sudah mantap.</p>', 0, '2022-02-05 07:54:09', '2022-02-05 07:54:09', NULL);
INSERT INTO `question_details` VALUES (233, 117, 'a', '<p>Saya akan meminta waktu untuk berdiskusi dengan keluarga saat mendapatkan tugas dengan resiko yang berat.</p>', 0, '2022-02-05 07:54:30', '2022-02-05 07:54:30', NULL);
INSERT INTO `question_details` VALUES (234, 117, 'b', '<p>Seberat apapun resiko perintah pimpinan, saya siap melaksanakannya.</p>', 1, '2022-02-05 07:54:30', '2022-02-05 07:54:30', NULL);
INSERT INTO `question_details` VALUES (235, 118, 'a', '<p>Berdasarkan prioritasnya meski tergolong sangat sulit saya kerjakan.</p>', 1, '2022-02-05 07:54:59', '2022-02-05 07:54:59', NULL);
INSERT INTO `question_details` VALUES (236, 118, 'b', '<p>Yang lebih mudah saya lakukan meski bukan prioritas paling utama.</p>', 0, '2022-02-05 07:54:59', '2022-02-05 07:54:59', NULL);
INSERT INTO `question_details` VALUES (237, 119, 'a', '<p>Saya akan menyapa, menanyakan kabarnya, bercerita, dan kemudian saling bertukar nomor telepon.</p>', 1, '2022-02-05 07:55:29', '2022-02-05 07:55:29', NULL);
INSERT INTO `question_details` VALUES (238, 119, 'b', '<p>Saya akan menegurnya dan bercerita secukupnya mengingat ini acara pribadi.</p>', 0, '2022-02-05 07:55:29', '2022-02-05 07:55:29', NULL);
INSERT INTO `question_details` VALUES (239, 120, 'a', '<p>Tidak masalah menggunakan jam kerja untuk kepentingan keluarga.&nbsp;</p>', 0, '2022-02-05 07:55:54', '2022-02-05 07:55:54', NULL);
INSERT INTO `question_details` VALUES (240, 120, 'b', '<p>Jam kerja harus digunakan untuk bekerja.</p>', 1, '2022-02-05 07:55:54', '2022-02-05 07:55:54', NULL);
INSERT INTO `question_details` VALUES (241, 121, 'a', '<p>Saya beranggapan setiap personil memiliki tugas, pekerjaan, dan tanggung jawabnya masing masing.&nbsp;</p>', 0, '2022-02-05 07:56:31', '2022-02-05 07:56:31', NULL);
INSERT INTO `question_details` VALUES (242, 121, 'b', '<p>Saat saya sedang bekerja namun ada rekan yang meminta bantuan, saya berusaha membantu sebisanya.</p>', 1, '2022-02-05 07:56:31', '2022-02-05 07:56:31', NULL);
INSERT INTO `question_details` VALUES (243, 122, 'a', '<p>Harapan dan cita-cita harus setinggi tingginya masalah bisa dan tidaknya kita mencapainya itu adalah faktor keberuntungan saja.</p>', 0, '2022-02-05 07:56:54', '2022-02-05 07:56:54', NULL);
INSERT INTO `question_details` VALUES (244, 122, 'b', '<p>Harapan dan cita-cita kita sesuaikan dengan kemampuan diri kita.&nbsp;</p>', 1, '2022-02-05 07:56:54', '2022-02-05 07:56:54', NULL);
INSERT INTO `question_details` VALUES (245, 123, 'a', '<p>Sebagai seorang pejabat publik, jangan sekali-kali membuat pernyataan yang tidak dapat&nbsp; direalisasikan.</p>', 1, '2022-02-05 07:57:17', '2022-02-05 07:57:17', NULL);
INSERT INTO `question_details` VALUES (246, 123, 'b', '<p>Pernyataan seorang pejabat publik adalah pernyataan politik, oleh karena itu wajar kalau tidak direalisasikan.</p>', 0, '2022-02-05 07:57:17', '2022-02-05 07:57:17', NULL);
INSERT INTO `question_details` VALUES (247, 124, 'a', '<p>Saya berusaha mencari alasan yang tepat agar dapat dipercaya orang lain.</p>', 0, '2022-02-05 07:57:42', '2022-02-05 07:57:42', NULL);
INSERT INTO `question_details` VALUES (248, 124, 'b', '<p>Untuk dapat dipercaya orang lain, saya harus tampil apa adanya.</p>', 1, '2022-02-05 07:57:42', '2022-02-05 07:57:42', NULL);
INSERT INTO `question_details` VALUES (249, 125, 'a', '<p>Saya merasa tidak siap bila diberikan tugas yang bersifat mendadak.</p>', 0, '2022-02-05 07:58:06', '2022-02-05 07:58:06', NULL);
INSERT INTO `question_details` VALUES (250, 125, 'b', '<p>Saya akan membuat rencana kerja walaupun sifatnya mendadak.</p>', 1, '2022-02-05 07:58:06', '2022-02-05 07:58:06', NULL);
INSERT INTO `question_details` VALUES (251, 126, 'a', '<p>Dalam kehidupan sehari-hari, jarang ada`teman kerja yang menolak membantu saya.&nbsp;</p>', 1, '2022-02-05 07:58:29', '2022-02-05 07:58:29', NULL);
INSERT INTO `question_details` VALUES (252, 126, 'b', '<p>Walaupun pekerjaan saya sangat berat, lebih baik saya lakukan pekerjaan sendiri karena seringkali teman enggan membantu.</p>', 0, '2022-02-05 07:58:29', '2022-02-05 07:58:29', NULL);
INSERT INTO `question_details` VALUES (253, 127, 'a', '<p>Di jaman sekarang ini sulit mengajak anggota untuk mau bekerja dengan jangka waktu mendesak.&nbsp;</p>', 0, '2022-02-05 07:58:51', '2022-02-05 07:58:51', NULL);
INSERT INTO `question_details` VALUES (254, 127, 'b', '<p>Saya yakin anggota&nbsp; bisa saya ajak bekerja dengan cepat dalam kondisi mendesak.</p>', 1, '2022-02-05 07:58:51', '2022-02-05 07:58:51', NULL);
INSERT INTO `question_details` VALUES (255, 128, 'a', '<p>Meskipun terpaksa saya tetap mengikuti ajakan teman agar hubungan tetap membaik.</p>', 0, '2022-02-05 07:59:16', '2022-02-05 07:59:16', NULL);
INSERT INTO `question_details` VALUES (256, 128, 'b', '<p>Lebih baik menolak ajakan teman yang kurang sesuai dengan hati nurani meskipun akan merusak hubungan persahabatan.</p>', 1, '2022-02-05 07:59:16', '2022-02-05 07:59:16', NULL);
INSERT INTO `question_details` VALUES (257, 129, 'a', '<p>Penilaian terhadap sesuatu masalah selalu saya sampaikan apa adanya sesuai fakta.</p>', 1, '2022-02-05 07:59:38', '2022-02-05 07:59:38', NULL);
INSERT INTO `question_details` VALUES (258, 129, 'b', '<p>Dalam menyampaikan suatu masalah perlu dipertimbangkan hal-hal yang dapat menyinggung perasaan orang.</p>', 0, '2022-02-05 07:59:38', '2022-02-05 07:59:38', NULL);
INSERT INTO `question_details` VALUES (259, 130, 'a', '<p>Pendapat orang lain yang berbeda dengan pemikiran saya tidak pernah saya gunakan sebagai dasar mengambil keputusan.</p>', 0, '2022-02-05 08:00:13', '2022-02-05 08:00:13', NULL);
INSERT INTO `question_details` VALUES (260, 130, 'b', '<p>Pendapat orang yang bertentangan dengan pemikiran saya kemungkinan ada benarnya.</p>', 1, '2022-02-05 08:00:13', '2022-02-05 08:00:13', NULL);
INSERT INTO `question_details` VALUES (261, 131, 'a', '<p>Dengan senang hati saya mau menyelesaikan tugas teman yang tidak masuk kerja, meskipun pulang terlambat.</p>', 1, '2022-02-05 08:00:40', '2022-02-05 08:00:40', NULL);
INSERT INTO `question_details` VALUES (262, 131, 'b', '<p>Saya tidak keberatan menyelesaikan tugas teman yang tidak masuk kerja semasih jam kerja.</p>', 0, '2022-02-05 08:00:40', '2022-02-05 08:00:40', NULL);
INSERT INTO `question_details` VALUES (263, 132, 'a', '<p>Memilih solusi yang paling minim resikonya, meski tetap menimbulkan banyak korban.</p>', 0, '2022-02-05 08:01:13', '2022-02-05 08:01:13', NULL);
INSERT INTO `question_details` VALUES (264, 132, 'b', '<p>Berkonsultasi pada orang yang saya nilai layak memberi saran, meski saya akan dianggap tidak punya ketegasan.</p>', 1, '2022-02-05 08:01:13', '2022-02-05 08:01:13', NULL);
INSERT INTO `question_details` VALUES (265, 133, 'a', '<p>Saya enggan dibantu rekan kerja yang sering mencela pekerjaan yang sudah saya lakukan dengan semaksimal usaha saya.</p>', 0, '2022-02-05 08:01:42', '2022-02-05 08:01:42', NULL);
INSERT INTO `question_details` VALUES (266, 133, 'b', '<p>Tidak masalah bagi saya bekerja dengan siapapun termasuk dengan rekan kerja yang berkarakter menjengkelkan.</p>', 1, '2022-02-05 08:01:42', '2022-02-05 08:01:42', NULL);
INSERT INTO `question_details` VALUES (267, 134, 'a', '<p>Sebagai atasan, jadwal bisa ditinggalkan untuk hal yang lebih penting.&nbsp;</p>', 0, '2022-02-05 08:02:06', '2022-02-05 08:02:06', NULL);
INSERT INTO `question_details` VALUES (268, 134, 'b', '<p>Sebagai atasan, jadwal merupakan panduan yang harus diikuti.&nbsp;</p>', 1, '2022-02-05 08:02:06', '2022-02-05 08:02:06', NULL);
INSERT INTO `question_details` VALUES (269, 135, 'a', '<p>Demi efisiensi pekerjaan, saya hanya mempersilahkan anggota yang ingin memberi masukan terkait masalah pekerjaan.</p>', 0, '2022-02-05 08:02:34', '2022-02-05 08:02:34', NULL);
INSERT INTO `question_details` VALUES (270, 135, 'b', '<p>Saya mempersilahkan anggota saya yang ingin bercerita, dan memberi masukan baik masalah pekerjaan sampai masalah keluarga meskipun harus menyita waktu.</p>', 1, '2022-02-05 08:02:34', '2022-02-05 08:02:34', NULL);
INSERT INTO `question_details` VALUES (271, 136, 'a', '<p>Menolak pekerjaan yang tidak mampu saya kerjakan.</p>', 1, '2022-02-05 08:02:59', '2022-02-05 08:02:59', NULL);
INSERT INTO `question_details` VALUES (272, 136, 'b', '<p>Menerima apapun pekerjaan walaupun kita tidak memiliki kemampuan untuk menyelesaikannya.</p>', 0, '2022-02-05 08:02:59', '2022-02-05 08:02:59', NULL);
INSERT INTO `question_details` VALUES (273, 137, 'a', '<p>Mudah bagi orang lain untuk menebak bagaimana sikap dan perilaku saya menghadapi suatu persoalan.</p>', 1, '2022-02-05 08:03:29', '2022-02-05 08:03:29', NULL);
INSERT INTO `question_details` VALUES (274, 137, 'b', '<p>Saya rasa tidak mungkin orang tahu sikap dan perilaku saya saat menghadapi persoalan.</p>', 0, '2022-02-05 08:03:29', '2022-02-05 08:03:29', NULL);
INSERT INTO `question_details` VALUES (275, 138, 'a', '<p>Bersedia menanggung resiko atas kesalahan saya.</p>', 1, '2022-02-05 08:03:58', '2022-02-05 08:03:58', NULL);
INSERT INTO `question_details` VALUES (276, 138, 'b', '<p>Mencari cara menghindari resiko atas kesalahan saya.</p>', 0, '2022-02-05 08:03:58', '2022-02-05 08:03:58', NULL);
INSERT INTO `question_details` VALUES (277, 139, 'a', '<p>Saya terbiasa bangun pagi jam lima pagi walaupun hari libur.</p>', 1, '2022-02-05 08:04:25', '2022-02-05 08:04:25', NULL);
INSERT INTO `question_details` VALUES (278, 139, 'b', '<p>Bila hari libur saya bangun agak siang karena tidak kerja juga.</p>', 0, '2022-02-05 08:04:25', '2022-02-05 08:04:25', NULL);
INSERT INTO `question_details` VALUES (279, 140, 'a', '<p>Sebelum mengambil keputusan saya akan melakukan pendekatan kepada anggota yang merasa keberatan.</p>', 1, '2022-02-05 08:04:48', '2022-02-05 08:04:48', NULL);
INSERT INTO `question_details` VALUES (280, 140, 'b', '<p>Saya merasa kurang pandai berbicara ketika mengharapkan bantuan dari anggota.&nbsp;</p>', 0, '2022-02-05 08:04:48', '2022-02-05 08:04:48', NULL);
INSERT INTO `question_details` VALUES (281, 141, 'a', '<p>Saya merasa perlu sesekali mendampingi dan mengajari anggota saya yang malas agar mereka tidak melakukan kesalahan yang sama.&nbsp;</p>', 1, '2022-02-05 08:20:38', '2022-02-05 08:20:38', NULL);
INSERT INTO `question_details` VALUES (282, 141, 'b', '<p>Ketika saya menghadapi anggota saya yang malas bekerja, saya akan terus menerus menyuruhnya sampai dia mau mengerjakan pekerjaan tersebut.</p>', 0, '2022-02-05 08:20:38', '2022-02-05 08:20:38', NULL);
INSERT INTO `question_details` VALUES (283, 142, 'a', '<p>Saya menegur anggota yang berbicara dalam barisan.</p>', 1, '2022-02-05 08:21:00', '2022-02-05 08:21:00', NULL);
INSERT INTO `question_details` VALUES (284, 142, 'b', '<p>Saya menegur anggota bila perilakunya sudah keterlaluan.</p>', 0, '2022-02-05 08:21:00', '2022-02-05 08:21:00', NULL);
INSERT INTO `question_details` VALUES (285, 143, 'a', '<p>Mempertimbangkan informasi apa yang dapat disampaikan apa adanya, dan tidak mengemukakan apa adanya hal-hal yang menyebabkan orang sangat emosi.</p>', 0, '2022-02-05 08:21:33', '2022-02-05 08:21:33', NULL);
INSERT INTO `question_details` VALUES (286, 143, 'b', '<p>Mengemukakan apa adanya informasi yang saya peroleh meskipun mungkin ada yang tersinggung.</p>', 1, '2022-02-05 08:21:33', '2022-02-05 08:21:33', NULL);
INSERT INTO `question_details` VALUES (287, 144, 'a', '<p>Saya arahkan anggota agar tidak langsung menyampaikan keluhan kepada saya mengingat ada hirarki jabatan.</p>', 0, '2022-02-05 08:21:56', '2022-02-05 08:21:56', NULL);
INSERT INTO `question_details` VALUES (288, 144, 'b', '<p>Saya menjadwalkan waktu khusus bagi anggota yang ingin menyampaikan keluhan.</p>', 1, '2022-02-05 08:21:56', '2022-02-05 08:21:56', NULL);
INSERT INTO `question_details` VALUES (289, 145, 'a', '<p>Sekalipun orang yang saya tidak saya sukai kini menjadi pimpinan saya, saya akan tetap mematuhi perintahnya.</p>', 1, '2022-02-05 08:22:18', '2022-02-05 08:22:18', NULL);
INSERT INTO `question_details` VALUES (290, 145, 'b', '<p>Lebih baik menghindar dari pimpinan yang tidak saya sukai agar tidak diberi tugas&nbsp; berlebihan.</p>', 0, '2022-02-05 08:22:18', '2022-02-05 08:22:18', NULL);
INSERT INTO `question_details` VALUES (291, 146, 'a', '<p>Daripada menunggu kuliah sia-sia, saya akan menggunakan waktu itu untuk urusan lain.</p>', 0, '2022-02-05 08:22:49', '2022-02-05 08:22:49', NULL);
INSERT INTO `question_details` VALUES (292, 146, 'b', '<p>Saya menunggu sambil mempelajari diktat kuliah yang akan disampaikan dosen.</p>', 1, '2022-02-05 08:22:49', '2022-02-05 08:22:49', NULL);
INSERT INTO `question_details` VALUES (293, 147, 'a', '<p>Sekalipun pimpinan lama, penting bagi saya untuk tetap menjaga silaturahmi dan&nbsp; hubungan baik karena beliau pernah membantu saya.</p>', 1, '2022-02-05 08:23:17', '2022-02-05 08:23:17', NULL);
INSERT INTO `question_details` VALUES (294, 147, 'b', '<p>Jangan terlalu mengutamakan hubungan dengan pimpinan lama karena jauh lebih penting mengurus hal hal yang berkaitan dengan pekerjaan.</p>', 0, '2022-02-05 08:23:17', '2022-02-05 08:23:17', NULL);
INSERT INTO `question_details` VALUES (295, 148, 'a', '<p>Prinsip saya lebih penting dari prinsip kelompok.</p>', 0, '2022-02-05 08:23:40', '2022-02-05 08:23:40', NULL);
INSERT INTO `question_details` VALUES (296, 148, 'b', '<p>Prinsip kelompok lebih penting dari prinsip saya.</p>', 1, '2022-02-05 08:23:40', '2022-02-05 08:23:40', NULL);
INSERT INTO `question_details` VALUES (297, 149, 'a', '<p>Butuh waktu yang lama untuk benar-benar mengetahui semua watak dan problema anggota saya.</p>', 0, '2022-02-05 08:24:00', '2022-02-05 08:24:00', NULL);
INSERT INTO `question_details` VALUES (298, 149, 'b', '<p>Saya mengenali semua watak dan problema rekan kerja dan anggota saya.</p>', 1, '2022-02-05 08:24:00', '2022-02-05 08:24:00', NULL);
INSERT INTO `question_details` VALUES (299, 150, 'a', '<p>Saya sering memasang target yang tinggi diatas kemampuan agar saya termotivasi.</p>', 0, '2022-02-05 08:24:21', '2022-02-05 08:24:21', NULL);
INSERT INTO `question_details` VALUES (300, 150, 'b', '<p>Saya sering memasang target yang tidak jauh dari kemampuan yang saya miliki.</p>', 1, '2022-02-05 08:24:21', '2022-02-05 08:24:21', NULL);
INSERT INTO `question_details` VALUES (301, 151, 'a', '<p>Apa yang saya rasakan ada kalanya bertentangan dengan apa yang saya lakukan atau ucapkan karena sesuatu hal.</p>', 0, '2022-02-05 08:24:45', '2022-02-05 08:24:45', NULL);
INSERT INTO `question_details` VALUES (302, 151, 'b', '<p>Apa yang saya rasakan sesuai dengan apa yang saya lakukan atau ucapkan.</p>', 1, '2022-02-05 08:24:45', '2022-02-05 08:24:45', NULL);
INSERT INTO `question_details` VALUES (303, 152, 'a', '<p>Berani berkata benar walaupun beresiko bagi saya.</p>', 1, '2022-02-05 08:25:08', '2022-02-05 08:25:08', NULL);
INSERT INTO `question_details` VALUES (304, 152, 'b', '<p>Mencari alasan pembenar untuk menghindari resiko.</p>', 0, '2022-02-05 08:25:08', '2022-02-05 08:25:08', NULL);
INSERT INTO `question_details` VALUES (305, 153, 'a', '<p>Saya menjalani aktifitas dalam kehidupan sehari-hari mengalir seperti air.</p>', 0, '2022-02-05 08:25:29', '2022-02-05 08:25:29', NULL);
INSERT INTO `question_details` VALUES (306, 153, 'b', '<p>Saya membuat rencana tentang apa yang akan saya lakukan setiap hari.</p>', 1, '2022-02-05 08:25:29', '2022-02-05 08:25:29', NULL);
INSERT INTO `question_details` VALUES (307, 154, 'a', '<p>Saya akan mengemukakan data-data yang mampu mendukung saran saya.&nbsp;</p>', 1, '2022-02-05 08:25:55', '2022-02-05 08:25:55', NULL);
INSERT INTO `question_details` VALUES (308, 154, 'b', '<p>Saya sangat berhati-hati saat harus menyampaikan data-data berkaitan dengan saran karena bisa membuat orang lain bingung.</p>', 0, '2022-02-05 08:25:55', '2022-02-05 08:25:55', NULL);
INSERT INTO `question_details` VALUES (309, 155, 'a', '<p>Saya ingin agar semua anggota dapat maksimal menyelesaikan tugas-tugasnya karena hal itu demi menjaga citra baik saya sebagai pimpinan mereka.&nbsp;</p>', 0, '2022-02-05 08:26:24', '2022-02-05 08:26:24', NULL);
INSERT INTO `question_details` VALUES (310, 155, 'b', '<p>Dalam meyelesaikan pekerjaan-pekerjaan yang mendesak saya akan mempersiapkan anggota dengan hal-hal yang dapat membantu stamina mereka.</p>', 1, '2022-02-05 08:26:24', '2022-02-05 08:26:24', NULL);
INSERT INTO `question_details` VALUES (311, 156, 'a', '<p>Bagi saya berdebat itu boleh selama masih bisa dipertanggungjawabkan hasilnya.</p>', 1, '2022-02-05 08:26:57', '2022-02-05 08:26:57', NULL);
INSERT INTO `question_details` VALUES (312, 156, 'b', '<p>Sedapat mungkin saya menghindari perdebatan dan perbedaan pendapat.</p>', 0, '2022-02-05 08:26:57', '2022-02-05 08:26:57', NULL);
INSERT INTO `question_details` VALUES (313, 157, 'a', '<p>Saya tidak akan memaklumi orang yang memberikan data palsu .</p>', 1, '2022-02-05 08:27:19', '2022-02-05 08:27:19', NULL);
INSERT INTO `question_details` VALUES (314, 157, 'b', '<p>Saya kadang-kadang bisa memaklumi orang yang memberikan data palsu asalkan untuk kebaikan.</p>', 0, '2022-02-05 08:27:19', '2022-02-05 08:27:19', NULL);
INSERT INTO `question_details` VALUES (315, 158, 'a', '<p>Saya lebih suka dinasehati oleh pimpinan daripada oleh bawahan atau rekan kerja.&nbsp;</p>', 0, '2022-02-05 08:27:41', '2022-02-05 08:27:41', NULL);
INSERT INTO `question_details` VALUES (316, 158, 'b', '<p>Nasehat dari siapapun saya terima walaupun kadang tidak semua benar adanya.</p>', 1, '2022-02-05 08:27:41', '2022-02-05 08:27:41', NULL);
INSERT INTO `question_details` VALUES (317, 159, 'a', '<p>Kalau keadaan terpaksa saya tetap mengusahakan sesedikit mungkin rahasia teman yang saya informasikan.</p>', 0, '2022-02-05 08:28:00', '2022-02-05 08:28:00', NULL);
INSERT INTO `question_details` VALUES (318, 159, 'b', '<p>Apapun yang terjadi, saya tidak akan menceritakan rahasia teman yang dipercayakan kepada saya.</p>', 1, '2022-02-05 08:28:00', '2022-02-05 08:28:00', NULL);
INSERT INTO `question_details` VALUES (319, 160, 'a', '<p>Menyiapkan diri untuk menyambut kebijakan baru itu, meski akhirnya tidak jadi diberlakukan.</p>', 1, '2022-02-05 08:28:32', '2022-02-05 08:28:32', NULL);
INSERT INTO `question_details` VALUES (320, 160, 'b', '<p>Bersama rekan-rekan menghadap pimpinan untuk menanyakan kepastian akan pemberlakuan kebijakan tersebut.</p>', 0, '2022-02-05 08:28:32', '2022-02-05 08:28:32', NULL);
INSERT INTO `question_details` VALUES (321, 161, 'a', '<p>Sudah tidak ada lagi waktu bagi saya untuk bersantai dan berkumpul bersama teman-teman karena hanya akan membuang waktu.</p>', 0, '2022-02-05 08:28:54', '2022-02-05 08:28:54', NULL);
INSERT INTO `question_details` VALUES (322, 161, 'b', '<p>Saya masih sering berkumpul dengan teman teman lama untuk tetap menjalin hubungan baik dengan mereka.</p>', 1, '2022-02-05 08:28:54', '2022-02-05 08:28:54', NULL);
INSERT INTO `question_details` VALUES (323, 162, 'a', '<p>Prinsip saya tidak bisa diganggu gugat.</p>', 1, '2022-02-05 08:29:16', '2022-02-05 08:29:16', NULL);
INSERT INTO `question_details` VALUES (324, 162, 'b', '<p>Jika prinsip saya ternyata kurang sesuai saya bisa mengabaikannya.</p>', 0, '2022-02-05 08:29:16', '2022-02-05 08:29:16', NULL);
INSERT INTO `question_details` VALUES (325, 163, 'a', '<p>Saya akan mencoba mengingat suasana hati saya ketika menghadapi tugas sejenis, dan hal-hal yang dapat merangsang semangat saya untuk saya terapkan pada rekan-rekan.</p>', 1, '2022-02-05 08:29:48', '2022-02-05 08:29:48', NULL);
INSERT INTO `question_details` VALUES (326, 163, 'b', '<p>Saya akan mendorong rekan-rekan mengerjakannya dengan menginformasikan bahwa tugas yang akan dihadapi menuntut keseriusan karena sifat pekerjaan ini membosankan.</p>', 0, '2022-02-05 08:29:48', '2022-02-05 08:29:48', NULL);
INSERT INTO `question_details` VALUES (327, 164, 'a', '<p>Walaupun sulit, saya berusaha untuk mengetahui kelebihan dan kekurangan saya.</p>', 1, '2022-02-05 08:30:11', '2022-02-05 08:30:11', NULL);
INSERT INTO `question_details` VALUES (328, 164, 'b', '<p>Berusaha mengetahui kekurangan dan kelebihan diri sendiri adalah usaha yang sia-sia</p>', 0, '2022-02-05 08:30:11', '2022-02-05 08:30:11', NULL);
INSERT INTO `question_details` VALUES (329, 165, 'a', '<p>Sebagai pimpinan haruslah membuat kebijakan baru sesuai dengan perkembangan lingkungan eksternal.</p>', 0, '2022-02-05 08:30:33', '2022-02-05 08:30:33', NULL);
INSERT INTO `question_details` VALUES (330, 165, 'b', '<p>Kebijakan-kebijakan pimpinan yang terdahulu harus dilanjutkan dan dijabarkan supaya dapat dilaksanakan.</p>', 1, '2022-02-05 08:30:33', '2022-02-05 08:30:33', NULL);
