INSERT INTO `questions` VALUES (322, 2, NULL, 11, '<p>Tino senang menabung. Setiap hari kecuali Minggu, Tino diberi uang saku oleh orang tuanya sebanyak Rp. 5000. Biasanya Tino hanya membelanjakan uangnya sebanyak Rp. 1.500,- / hari dan sisanya ditabung di celengan. Berapa banyak uang pecahan Rp.500 yang Tino peroleh jika membongkar celengan selama seminggu?</p>', '2022-02-06 07:39:20', '2022-02-06 07:39:20', NULL);
INSERT INTO `questions` VALUES (323, 2, NULL, 12, '<p>Jika seorang buruh digaji selama satu bulan (30 hari) sejumlah Rp. 1.311.000 / bulan karena tidak masuk selama 7 hari, maka berapakah upah per hari buruh tersebut?</p>', '2022-02-06 07:40:14', '2022-02-06 07:40:14', NULL);
INSERT INTO `questions` VALUES (324, 2, NULL, 13, '<p>Dido ingin menjadi seorang Polri, syarat menjadi seorang Polri adalah sehat jasmani. Awalnya Dido dapat berlari di halaman Gelora Bung Karno (GBK) sebanyak 3 putaran. Keliling halaman GBK adalah 700 m. Jika setiap minggu Dido mampu meningkatkan ketahanan berlarinya sebanyak 1 putaran, berapa putaran yang dapat dicapai Dido 4 minggu kemudian jika Dido berlari di Lapangan Bhayangkara Mabes Polri yang hanya 400 m?</p>', '2022-02-06 07:41:09', '2022-02-06 07:41:09', NULL);
INSERT INTO `questions` VALUES (325, 2, NULL, 14, '<p>Di dalam sebuah peti terdapat 7 pucuk senjata yang masing masing senjata memiliki tipe dan jenis yang berbeda. Jika di gudang senjata terdapat 137 peti senjata berapa banyak pucuk senjata yang ada di dalam gudang tersebut ?</p>', '2022-02-06 07:41:54', '2022-02-06 07:41:54', NULL);
INSERT INTO `questions` VALUES (326, 2, NULL, 15, '<p>Desi menyewakan kedua mobilnya selama satu minggu. Mobil A disewakan dengan harga Rp.2.500/hari. Bila dari penyewaan kedua mobil tersebut Desi menerima uang sebesar Rp. 36.750,- maka mobil B disewakan Desi per hari dengan harga?</p>', '2022-02-06 07:42:37', '2022-02-06 07:42:37', NULL);
INSERT INTO `questions` VALUES (327, 2, NULL, 16, '<p>Sebuah bus Trans Jakarta menempuh perjalanan dari halte Ragunan ke halte Kuningan dengan kecepatan rata-rata 40 km / jam dan kembali dengan kecepatan rata-rata 60 km / jam. Jika jarak dari halte Ragunan ke halte Kuningan adalah 120 km. Berapakah kecepatan rata-rata untuk seluruh perjalanan?</p>', '2022-02-06 07:43:19', '2022-02-06 07:43:19', NULL);
INSERT INTO `questions` VALUES (328, 2, NULL, 17, '<p>Demi menambah berat badannya agar dapat bersaing di kelasnya, Chris John berlatih beban&nbsp;selama 25 menit per hari dan banyak mengonsumsi makanan yang mengandung karbohidrat dan protein tinggi sehingga mampu menaikkan berat badannya sebanyak 5 kg. Seandainya Chris John meningkatkan waktu latihannya menjadi 50 menit tiap hari, maka kira-kira berapa kg berat badan yang dapat ia naikkan?</p>', '2022-02-06 07:43:59', '2022-02-06 07:43:59', NULL);
INSERT INTO `questions` VALUES (329, 2, NULL, 18, '<p>Kunjungan Gubernur DKI dan jajaran ke beberapa wilayah banjir di Jakarta untuk memberikan pengarahan dan penyuluhan waspada penyakit kulit pasca banjir kepada warga dengan tujuan mencegah wabah penyakit yang kerap terjadi di wilayah itu. Kegiatan tersebut mulai menunjukkan hasil yang positif. Selama sebulan terakhir, Gubernur berkunjung ke 5 wilayah rawan banjir dan berhasil menurunkan kasus penyebaran wabah sebanyak 10%. Apabila Gubernur DKI dan jajaran meningkatkan jumlah wilayah yang ia kunjungi sebanyak dua kali lipat dari yang ia kunjungi dalam sebulan terakhir, berapa persen kira-kira kasus penyebaran wabah penyakit&nbsp;yang dapat diturunkan?</p>', '2022-02-06 07:44:41', '2022-02-06 07:44:41', NULL);
INSERT INTO `questions` VALUES (330, 2, NULL, 19, '<p>Dari hasil Klasmen sementara Liga Spanyol, Real Sociedad berada pada urutan sembilan belas dari atas dan juga termasuk urutan sembilan belas dari bawah. Dari hasil klasmen sementara tersebut, ada berapa klub yang tergabung dalam Liga Spanyol tersebut?</p>', '2022-02-06 07:45:22', '2022-02-06 07:45:22', NULL);
INSERT INTO `questions` VALUES (331, 2, NULL, 20, '<p>Di Polda Papua Barat, jumlah peserta secara keseluruhan yang mengikuti ujian psikologi seleksi Brigadir Polri masih tersisa 100 orang yaitu 50 peserta laki-laki dan 50 peserta perempuan. Peserta yang dinyatakan lulus berjumlah 50 orang dan yang belum lulus berjumlah 50 orang. Dari yang sudah lulus, 50% adalah laki-laki dan 50% sisanya perempuan. Dengan demikian, berapa orang jumlah peserta perempuan yang belum lulus uji psikologi?</p>', '2022-02-06 07:46:03', '2022-02-06 07:46:03', NULL);
