INSERT INTO `questions` VALUES (352, 2, NULL, 41, '<p>Samsat Daan Mogot merekrut PHL sebanyak tiga kali jumlah PHL tahun lalu. Tahun lalu PHL nya berjumlah 29 orang, yang keluar tiga orang dan yang masuk sebanyak dua kali lipat dari jumlah yang keluar. Setelah itu jumlah PHL-nya tidak berubah hingga sekarang. Berapakah jumlah PHL Samsat Daan Mogot sekarang?</p>', '2022-02-06 08:27:38', '2022-02-06 08:27:38', NULL);
INSERT INTO `questions` VALUES (353, 2, NULL, 42, '<p>Seseorang saat ini berusia 6 windu. 5 tahun masa hidupnya ia habiskan di kota A dan 15 tahun di kota B. Kemudian ia menghabiskan 17 tahun hidupnya di kota C. Berapa tahun ia tinggal di tempatnya sekarang ini?</p>', '2022-02-06 08:28:18', '2022-02-06 08:28:18', NULL);
INSERT INTO `questions` VALUES (354, 2, NULL, 43, '<p>Agar dapat sampai ke tempat tugas 2 kali lebih cepat dibandingkan dengan berjalan kaki, Kompol Bima sebaiknya mengendarai motor. Hari ini, Kompol Bima terpaksa berjalan kaki dari rumahnya ke tempat tugas dan itu menghabiskan waktu selama 50 menit. Jarak dari rumahnya ke tempat tugas adalah 1 km. Seandainya Kompol Bima pergi dari rumah ke tempat tugas dengan mengendarai motornya, maka berapa kecepatan rata-rata Kompol Bima untuk sampai ke tempat tugas dari rumahnya?</p>', '2022-02-06 08:29:00', '2022-02-06 08:29:00', NULL);
INSERT INTO `questions` VALUES (355, 2, NULL, 44, '<p>AKP Arini yang hendak apel pagi terjebak kemacetan parah di jalan Tendean selama setengah jam. AKP Arini berangkat dari rumah tepat pukul 06.00, namun karena macet, baru tiba di kantor pada pukul 08.30. Jika mobil AKP Arini berkecepatan rata-rata 50 km/jam, maka berapa jarak yang telah ditempuh AKP Arini dari rumah ke kantor?</p>', '2022-02-06 08:29:38', '2022-02-06 08:29:38', NULL);
