INSERT INTO `questions` VALUES (372, 2, NULL, 61, '<p>Panitia reuni Sespimmen angkatan 50 mengedarkan undangan kepada 70 orang tamu laki-laki dan 50 orang tamu perempuan. Apabila 40% undangan perempuan dan 50% undangan laki-laki yang bisa hadir, berapa persen kah undangan yang tidak hadir?</p>', '2022-02-06 08:57:33', '2022-02-06 08:57:33', NULL);
INSERT INTO `questions` VALUES (373, 2, NULL, 62, '<p>Anita merupakan kakak dari Agus. Mereka masing masing memiliki sepeda. Sepeda Anita lebih besar dari sepeda Agus, dan apabila Anita mengayuh sebanyak 2 kali Agus harus mengayuh sebanyak 4 kali. Keliling rumah mereka adalah 400 m apabila Anita mengayuh sepeda sebanyak 8 kali dia dapat berjalan sejauh 4 meter, berapa kali&nbsp; Agus harus mengayuh sepedanya&nbsp; apabila ingin mengelilingi rumahnya?</p>', '2022-02-06 08:58:11', '2022-02-06 08:58:11', NULL);
INSERT INTO `questions` VALUES (374, 2, NULL, 63, '<p>Dalam setahun Polda X mendapat anggaran dana sebanyak 100 juta yang nantinya akan digunakan untuk keperluan operasional polda seperti rapat, jaldis personel, kunjungan, gelar pasukan dll. Apabila polda X setiap bulan wajib mengadakan rapat, gelar pasukan setahun dilaksanakan sebanyak 6 kali, kunjungan ke Polres dilakukan 10 kali dalam setahun dengan jumlah personel yang berangkat sebanyak 5 orang dengan masing masing kegiatan mengeluarkan dana yang berbeda yakni :</p><ul><li>1 x Rapat = Rp. 3.750.000</li><li>1x Gelar pasukan = Rp. 2.410.000</li><li>1x Kunjungan = Rp. 3.114.000</li><li>Jaldis personel Rp. 50.000 / orang.</li></ul><p>Berapa banyak dana yang dapat diserap Polda X selama setahun?&nbsp;</p>', '2022-02-06 08:59:06', '2022-02-06 08:59:06', NULL);
INSERT INTO `questions` VALUES (375, 2, NULL, 64, '<p>Mahasiswa PTIK sedang menghadapi ujian. Semua mata pelajaran harus diikuti untuk lulus pada semester ini. Syarat lulusnya adalah nilai rata-rata 70. Adapun mata pelajaran yang diujikan adalah Kepemimpinan, Kapita selekta, KUHP, KUHAP, dan Fungsi Intel.&nbsp;</p><ul><li>Rahmat mendapat nilai 70, 60, 56, 75, dan 50</li><li>Dani mendapat nilai 70, 68, 72, 55, dan 85</li><li>Bagus mendapat nilai 50, 85, 75, 70, dan 78</li><li>Zainal mendapat nilai 60, 80, 77, 91, dan 73</li><li>Sedangkan Rozi mendapat nilai 67, 71, 58, 75, dan 85&nbsp;</li></ul><p>Dari kelima mahasiswa PTIK tersebut, nilai siapakah yang tertinggi dan yang tidak lulus?</p>', '2022-02-06 09:00:28', '2022-02-06 09:00:28', NULL);
INSERT INTO `questions` VALUES (376, 2, NULL, 65, '<p>Jarak rumah Kompol Taufik ke kantor adalah 15 km, setiap pagi Kompol Taufik berangkat dari rumah pukul 05.00 wib, sebelum kekantor Kompol Taufik harus mengantar anaknya terlebih dahulu ke sekolah pada hari Senin, Rabu dan Jumat. Sekolah anaknya berjarak 7 km dari rumah, jarak sekolah anak ke kantor adalah 3 km. Jika Kompol Taufik dapat menempuh jarak 5 km dalam waktu 30 menit pukul berapa Kompol Taufik tiba di kantor pada hari Selasa?</p>', '2022-02-06 09:01:12', '2022-02-06 09:01:12', NULL);
INSERT INTO `questions` VALUES (377, 2, NULL, 66, '<p>Berdasarkan angkatannya, Kompol Daru lebih muda dari Kompol Fidel, namun Kompol Fidel masih lebih muda dari Kompol Yudi dan Kompol Indra. Kompol Indra lebih senior dari Kompol Yudi. Siapa di antara mereka yang angkatannya paling tua?</p>', '2022-02-06 09:01:48', '2022-02-06 09:01:48', NULL);
INSERT INTO `questions` VALUES (378, 2, NULL, 67, '<p>Dari data Infopers Polri diketahui, Bagas lebih senior dari Rina. Edi lebih senior dari Aldo. Siska tidak lebih senior dari Aldo. Tidak ada seorangpun yang memiliki tingkat senioritas yang sama. Apabila Bagas tidak lebih senior dari Siska, maka:</p>', '2022-02-06 09:02:26', '2022-02-06 09:02:26', NULL);
INSERT INTO `questions` VALUES (379, 2, NULL, 68, '<p>Dari hasil babak penyisihan, skor Barcelona kalah tinggi dibanding skor Real Madrid, tetapi skor Real Madrid sama dengan skor Valencia. Skor Real Betis adalah yang paling tinggi di antara semua tim. Skor Valencia lebih tinggi dari skor Ath.Madrid. Ini berarti:</p>', '2022-02-06 09:03:08', '2022-02-06 09:03:08', NULL);
INSERT INTO `questions` VALUES (380, 2, NULL, 69, '<p><strong>Teks 1 (soal nomor 69 dan 70)</strong></p><p><strong>&nbsp;</strong>Di acara pisah sambut salah seorang perwira tinggi Polri, beberapa tamu VIP datang dengan urutan sebagai berikut:</p><ul><li>Pak Wandi datang sebelum Pak Omar</li><li>Ibu Lady datang sebelum Pak Wandi</li><li>Pak Omar datang setelah Ibu Marni</li></ul><p>Jika Pak Wiryo adalah yang tamu yang datang paling akhir, Pak Wandi datang setelah Ibu Marni, dan kedatangan Ibu Lady sebelum Ibu Marni. Maka mana urutan di bawah ini yang mungkin benar menggambarkan urutan tamu VIP yang datang paling awal hingga paling akhir adalah:</p>', '2022-02-06 09:04:49', '2022-02-06 09:04:49', NULL);
