INSERT INTO `questions` VALUES (402, 2, NULL, 91, '<p>Ukuran sepatu Briptu Hilda sama dengan Briptu Fera. Ukuran sepatu Briptu Eka lebih besar daripada Briptu Winda. Ukuran sepatu Briptu Avy lebih besar daripada Briptu Tia. Apabila diperhatikan, hanya terdapat dua anggota yang memiliki ukuran sepatu sama. Lalu, apabila ukuran sepatu Briptu Hilda lebih besar daripada Briptu Avy, maka berarti:</p>', '2022-02-06 09:26:33', '2022-02-06 09:26:33', NULL);
INSERT INTO `questions` VALUES (403, 2, NULL, 92, '<p><strong>Teks 2 (soal nomor 92 dan 93)</strong></p><p>Dalam pertandingan lari sprint antar wilayah,ada empat orang pelari yang menjadi peserta pertandingan itu antara lain Ucup, Ocid, Wakwaw, dan Mastur. Satu sesi tanding mempertemukan dua pelari sehingga hasil akhir dari total enam sesi sprint yang digelar adalah sebagai berikut:</p><ul><li>Wakwaw mengalahkan Mastur.</li><li>Ocid berhasil dikalahkan oleh Ucup.</li><li>Ucup dan Ocid dikalahkan oleh Wakwaw</li><li>Mastur berhasil mengalahkan Ucup dan Ocid.</li></ul><p>Siapakah pelari yang selalu kalah dalam bertanding?</p>', '2022-02-06 09:27:41', '2022-02-06 09:27:41', NULL);
INSERT INTO `questions` VALUES (404, 2, NULL, 93, '<p><strong>Teks 2 (soal nomor 92 dan 93)</strong></p><p>Dalam pertandingan lari sprint antar wilayah,ada empat orang pelari yang menjadi peserta pertandingan itu antara lain Ucup, Ocid, Wakwaw, dan Mastur. Satu sesi tanding mempertemukan dua pelari sehingga hasil akhir dari total enam sesi sprint yang digelar adalah sebagai berikut:</p><ul><li>Wakwaw mengalahkan Mastur.</li><li>Ocid berhasil dikalahkan oleh Ucup.</li><li>Ucup dan Ocid dikalahkan oleh Wakwaw</li><li>Mastur berhasil mengalahkan Ucup dan Ocid.</li></ul><p>Siapakah pelari yang memenangkan semua pertandingan?</p>', '2022-02-06 09:28:23', '2022-02-06 09:28:23', NULL);
INSERT INTO `questions` VALUES (405, 2, NULL, 94, '<p><strong>Teks 3 (soal nomor 94 dan 95)</strong></p><p>Dari data sejumlah perwira menengah yang ada, diketahui:</p><ul><li>Pangkat Abi lebih rendah daripada Yudo</li><li>Pangkat Abi lebih rendah daripada Pandu</li><li>Pangkat Deny lebih tinggi daripada Pandu</li></ul><p>Manakah pernyataan berikut ini yang mungkin paling benar?</p>', '2022-02-06 09:29:34', '2022-02-06 09:29:34', NULL);
INSERT INTO `questions` VALUES (406, 2, NULL, 95, '<p><strong>Teks 3 (soal nomor 94 dan 95)</strong></p><p>Dari data sejumlah perwira menengah yang ada, diketahui:</p><ul><li>Pangkat Abi lebih rendah daripada Yudo</li><li>Pangkat Abi lebih rendah daripada Pandu</li><li>Pangkat Deny lebih tinggi daripada Pandu</li></ul><p>Jika ada seorang perwira bernama Dodi yang pangkatnya lebih tinggi daripada Yudo, maka manakah pernyataan berikut ini yang benar?</p>', '2022-02-06 09:30:39', '2022-02-06 09:30:39', NULL);
