INSERT INTO `questions` VALUES (920, 14, NULL, 22, '<p><strong>Wacana&nbsp;I.&nbsp;(untuk&nbsp;mengerjakan&nbsp;no.&nbsp;22&nbsp;s/d&nbsp;24)</strong></p><p>Kasus&nbsp;<i>bullying&nbsp;</i>dan penganiayaan gadis berusia 14 tahun asal Kalimantan Barat yang pada awalnya diberitakan dikeroyok oleh belasan temannya memang mendapat sorotan tajam dari masyarakat. Tak sekali dua kali kasus&nbsp;<i>bullying </i>dan penganiayaan kerap muncul dan terjadi pada anak-anak dan remaja. Banyak&nbsp;masyarakat &nbsp;geram&nbsp;kepada&nbsp;para&nbsp;pelaku penganiayaan&nbsp;AU.&nbsp;Tak&nbsp;hanya&nbsp;di&nbsp;dunia&nbsp;nyata, <i>netizen&nbsp;</i>di&nbsp;dunia&nbsp;maya&nbsp;pun&nbsp;ikut&nbsp;menghujat,&nbsp;mengutuk,&nbsp;dan&nbsp;berharap&nbsp;para&nbsp;pelaku&nbsp;mendapat hukuman&nbsp;yang&nbsp;seberat-beratnya.&nbsp;KPAI&nbsp;(Komisi&nbsp;Perlindungan&nbsp;Anak Indonesia) mengeluarkan tiga sikap dalam menindaklanjuti kasus penganiayaan AU, salah satunya KPAI&nbsp;menghimbau&nbsp;agar&nbsp;kepolisian&nbsp;menggunakan&nbsp;UU&nbsp;Sistem&nbsp;Peradilan Pidana&nbsp;Anak&nbsp;No.&nbsp;11&nbsp;Tahun&nbsp;2012.</p><p>Berdasarkan&nbsp;wacana&nbsp;di&nbsp;atas&nbsp;manakah&nbsp;pernyataan&nbsp;yang&nbsp;TIDAK&nbsp;BENAR?</p>', '2022-03-08 21:35:39', '2022-03-08 21:38:04', NULL);
