INSERT INTO `questions` VALUES (925, 14, NULL, 27, '<p>Indonesia adalah negara terluas di ASEAN, wilayahnya dipisahkan dengan lautan. Untuk itu,&nbsp;pembangunan infrastruktur yang berkelanjutan sangat dibutuhkan. Hanya saja pembangunan itu&nbsp;tidak dapat didanai keseluruhannya dengan APBN. Menteri Keuangan (Menkeu) Sri Mulyani&nbsp;Indrawati menyebut,&nbsp;untuk&nbsp;menopang keberlanjutan&nbsp;pembangunan&nbsp;infrastruktur&nbsp;di&nbsp;Indonesia&nbsp;dibutuhkan partisipasi pihak swasta. Semua itu dikerjakan dengan skema&nbsp;<i>Public Private Partnership&nbsp;</i>(PPP)&nbsp;atau&nbsp;Kerjasama Pemerintah&nbsp;Badan&nbsp;Usaha&nbsp;(KPBU).</p><p>Tema&nbsp;dari&nbsp;bacaan&nbsp;di&nbsp;atas&nbsp;adalah&nbsp;...</p>', '2022-03-08 21:43:18', '2022-03-08 21:43:18', NULL);
INSERT INTO `questions` VALUES (926, 14, NULL, 28, '<p>Negara-negara&nbsp;Asia&nbsp;Tenggara menjadi&nbsp;anggota&nbsp;ASEAN. Semua&nbsp;Menteri&nbsp;Luar&nbsp;Negeri&nbsp;ASEAN&nbsp;sedang&nbsp;mengadakan&nbsp;konferensi&nbsp;di&nbsp;Jakarta. Filipina adalah&nbsp;negara&nbsp;di&nbsp;Asia&nbsp;Tenggara.</p><p>Kesimpulan&nbsp;yang&nbsp;paling&nbsp;tepat&nbsp;adalah&nbsp;</p>', '2022-03-08 21:44:30', '2022-03-08 21:44:30', NULL);
INSERT INTO `questions` VALUES (927, 14, NULL, 29, '<p>Panitia HUT Kemerdekaan RI mengadakan perlombaan fotografi di Bandung. Semua peserta dalam&nbsp;kegiatan&nbsp;lomba tersebut adalah mahasiswa dari Bandung. Gatot berpartisipasi dalam perlombaan&nbsp;tersebut&nbsp;sebagai&nbsp;peserta.</p><p>Kesimpulan&nbsp;paling&nbsp;tepat&nbsp;yang&nbsp;dapat&nbsp;ditarik&nbsp;berdasarkan&nbsp;ketiga&nbsp;pernyataan&nbsp;di&nbsp;atas&nbsp;adalah...</p>', '2022-03-08 21:45:51', '2022-03-08 21:45:51', NULL);
INSERT INTO `questions` VALUES (928, 14, NULL, 30, '<p>Apel&nbsp;pagi&nbsp;berlangsung&nbsp;di&nbsp;Monas. Monas&nbsp;ditutup&nbsp;hari&nbsp;ini&nbsp;hingga&nbsp;3&nbsp;hari&nbsp;ke&nbsp;depan. Gatot&nbsp;dan&nbsp;Sakti&nbsp;berencana lari&nbsp;pagi&nbsp;di&nbsp;Monas&nbsp;esok&nbsp;hari.</p><p>Kesimpulan&nbsp;yang&nbsp;paling&nbsp;tepat&nbsp;yang&nbsp;dapat&nbsp;ditarik&nbsp;berdasarkan&nbsp;ketiga&nbsp;pernyataan&nbsp;di&nbsp;atas&nbsp;adalah&nbsp;</p>', '2022-03-08 21:47:03', '2022-03-08 21:47:03', NULL);
